"use strict";(self.webpackChunkwoodpecker=self.webpackChunkwoodpecker||[]).push([["5690"],{41661:function(e){e.exports=JSON.parse('[{"name":"Git Clone","slug":"git-clone","url":"https://github.com/woodpecker-ci/plugin-git","icon":"https://raw.githubusercontent.com/woodpecker-ci/plugin-git/main/git.svg","description":"This is the default plugin for the clone step.","docs":"<h1>plugin-git</h1>\\n<p>This plugin is automatically introduced into your pipeline as the first step.\\nIts purpose is to clone your Git repository.</p>\\n<h2>Features</h2>\\n<ul>\\n<li>Git LFS support is enabled by default.</li>\\n<li>Fetch tags when needed.</li>\\n<li>Adjust submodules.</li>\\n</ul>\\n<h2>Overriding Settings</h2>\\n<p>You can manually define your <code>clone</code> step in order to change plugin or override some of the default settings.\\nConsult <a href=\\"https://woodpecker-ci.org/docs/usage/workflow-syntax#clone\\">the <code>clone</code> section of the pipeline documentation</a> for more information;\\nthis documentation page only describes this plugin.</p>\\n<pre><code class=\\"language-yaml\\">clone:\\n  git:\\n    image: woodpeckerci/plugin-git\\n    settings:\\n      depth: 50\\n      lfs: false\\n</code></pre>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings Name</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>depth</code></td>\\n<td><em>none</em></td>\\n<td>If specified, uses git\'s <code>--depth</code> option to create a shallow clone with a limited number of commits, overwritten by <code>partial</code>. Setting it to <code>0</code> disables shallow cloning</td>\\n</tr>\\n<tr>\\n<td><code>lfs</code></td>\\n<td><code>true</code></td>\\n<td>Set this to <code>false</code> to disable retrieval of LFS files</td>\\n</tr>\\n<tr>\\n<td><code>recursive</code></td>\\n<td><code>false</code></td>\\n<td>Clones submodules recursively</td>\\n</tr>\\n<tr>\\n<td><code>skip-verify</code></td>\\n<td><code>false</code></td>\\n<td>Skips the SSL verification</td>\\n</tr>\\n<tr>\\n<td><code>tags</code></td>\\n<td><code>false</code> (except on tag event)</td>\\n<td>Fetches tags when set to true, default is false if event is not tag else true</td>\\n</tr>\\n<tr>\\n<td><code>submodule-override</code></td>\\n<td><em>none</em></td>\\n<td>Override submodule urls</td>\\n</tr>\\n<tr>\\n<td><code>submodule-update-remote</code></td>\\n<td><code>false</code></td>\\n<td>Pass the --remote flag to git submodule update</td>\\n</tr>\\n<tr>\\n<td><code>submodule-partial</code></td>\\n<td><code>true</code></td>\\n<td>Update submodules via partial clone (depth=1)</td>\\n</tr>\\n<tr>\\n<td><code>custom-ssl-path</code></td>\\n<td><em>none</em></td>\\n<td>Set path to custom cert</td>\\n</tr>\\n<tr>\\n<td><code>custom-ssl-url</code></td>\\n<td><em>none</em></td>\\n<td>Set url to custom cert</td>\\n</tr>\\n<tr>\\n<td><code>backoff</code></td>\\n<td><code>5sec</code></td>\\n<td>Change backoff duration</td>\\n</tr>\\n<tr>\\n<td><code>attempts</code></td>\\n<td><code>5</code></td>\\n<td>Change backoff attempts</td>\\n</tr>\\n<tr>\\n<td><code>branch</code></td>\\n<td>$CI_COMMIT_BRANCH</td>\\n<td>Change branch name to checkout to</td>\\n</tr>\\n<tr>\\n<td><code>partial</code></td>\\n<td><code>true</code> (except if tags are fetched)</td>\\n<td>Only fetch the one commit and it\'s blob objects to resolve all files, overwrite depth with 1</td>\\n</tr>\\n<tr>\\n<td><code>home</code></td>\\n<td></td>\\n<td>Change HOME var for commands executed, fail if it does not exist</td>\\n</tr>\\n<tr>\\n<td><code>remote</code></td>\\n<td>$CI_REPO_CLONE_URL</td>\\n<td>Set the git remote url</td>\\n</tr>\\n<tr>\\n<td><code>remote-ssh</code></td>\\n<td>$CI_REPO_CLONE_SSH_URL</td>\\n<td>Set the git SSH remote url</td>\\n</tr>\\n<tr>\\n<td><code>object-format</code></td>\\n<td>detected from commit SHA</td>\\n<td>Set the object format for Git initialization. Supported values: <code>sha1</code>, <code>sha256</code>.</td>\\n</tr>\\n<tr>\\n<td><code>sha</code></td>\\n<td>$CI_COMMIT_SHA</td>\\n<td>git commit hash to retrieve</td>\\n</tr>\\n<tr>\\n<td><code>ref</code></td>\\n<td><em>none</em></td>\\n<td>Set the git reference to retrieve</td>\\n</tr>\\n<tr>\\n<td><code>path</code></td>\\n<td>$CI_WORKSPACE</td>\\n<td>Set destination path to clone to</td>\\n</tr>\\n<tr>\\n<td><code>use-ssh</code></td>\\n<td><code>false</code></td>\\n<td>Clone using SSH</td>\\n</tr>\\n<tr>\\n<td><code>ssh-key</code></td>\\n<td><em>none</em></td>\\n<td>SSH key for SSH clone</td>\\n</tr>\\n</tbody></table>\\n","tags":["git","clone"],"author":"Woodpecker Authors","containerImage":"woodpeckerci/plugin-git","containerImageUrl":"https://hub.docker.com/r/woodpeckerci/plugin-git","verified":true,"iconDataUrl":"data:image/svg+xml;base64,"},{"name":"Codecov","slug":"codecov","url":"https://github.com/woodpecker-ci/plugin-codecov","icon":"https://raw.githubusercontent.com/woodpecker-ci/plugin-codecov/main/codecov.svg","description":"Plugin to upload coverage reports to Codecov.io.","docs":"<h1>Codecov</h1>\\n<p>The Codecov plugin uploads coverage reports in one of the <a href=\\"https://docs.codecov.com/docs/supported-report-formats\\">supported formats</a> to <a href=\\"https://about.codecov.io/\\">Codecov.io</a>.</p>\\n<h2>Usage</h2>\\n<p>To use the plugin add a step similar to the following one to your Woodpecker pipeline config:</p>\\n<pre><code class=\\"language-yml\\">pipeline:\\n  codecov:\\n    image: woodpeckerci/plugin-codecov\\n    settings:\\n      files:\\n        - my-coverage-report-output.out\\n        - another-coverage-report.json\\n      token:\\n        from_secret: codecov_token\\n</code></pre>\\n","tags":["coverage","testing"],"author":"Woodpecker Authors","containerImage":"woodpeckerci/plugin-codecov","containerImageUrl":"https://hub.docker.com/r/woodpeckerci/plugin-codecov","verified":true,"iconDataUrl":"data:image/svg+xml;base64,"},{"name":"Extend env plugin","slug":"extend-env-plugin","url":"https://github.com/woodpecker-ci/plugin-extend-env","description":"Extend your .env file with additional variables like semver information.","docs":"<h1>plugin-extend-env</h1>\\n<p>The extend env plugin extends an existing or creates a new <code>.env</code> file with additional variables like semver information.</p>\\n<p>The below pipeline configuration demonstrates simple usage:</p>\\n<pre><code class=\\"language-yml\\">steps:\\n  extend-env:\\n    image: woodpeckerci/plugin-extend-env\\n</code></pre>\\n","tags":["env","semver"],"author":"Woodpecker Authors","containerImage":"woodpeckerci/plugin-extend-env","containerImageUrl":"https://hub.docker.com/r/woodpeckerci/plugin-extend-env","verified":true},{"name":"Gitea Comment","slug":"gitea-comment","url":"https://github.com/markopolo123/gitea-comment-plugin","description":"Plugin to add comments to a Gitea Pull Request","docs":"<p>A Woodpecker plugin to post comments onto a Gitea Pull Request.</p>\\n<h2>Usage</h2>\\n<p>Example pipeline:</p>\\n<pre><code class=\\"language-yaml\\">pipeline:\\n  comment:\\n    image: mcs94/gitea-comment\\n    settings:\\n      gitea_address: https://gitea.url.goes.here\\n      gitea_token:\\n        from_secret: gitea_token\\n      comment: &gt;\\n        \u2705 Build ${CI_BUILD_EVENT} of `${CI_REPO_NAME}` has status `${CI_BUILD_STATUS}`.\\n\\n        \uD83D\uDCDD Commit by ${CI_COMMIT_AUTHOR} on `${CI_COMMIT_BRANCH}`:\\n\\n        `${CI_COMMIT_MESSAGE}`\\n\\n        \uD83C\uDF10 ${CI_BUILD_LINK}\\n    when:\\n      event: [pull_request]\\n</code></pre>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Name</th>\\n<th>Description</th>\\n<th>Default</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>gitea_address</code></td>\\n<td>URL for your gitea instance</td>\\n<td>none</td>\\n</tr>\\n<tr>\\n<td><code>gitea_token</code></td>\\n<td>Gitea API token</td>\\n<td>none</td>\\n</tr>\\n<tr>\\n<td><code>comment</code></td>\\n<td>comment to add to Pull Request</td>\\n<td>none</td>\\n</tr>\\n</tbody></table>\\n","tags":["Gitea","comment"],"author":"markopolo123","containerImage":"mcs94/gitea-comment","containerImageUrl":"https://hub.docker.com/r/mcs94/gitea-comment","verified":false},{"name":"woodpecker-gitea-publisher-golang","slug":"woodpecker-gitea-publisher-golang","url":"https://github.com/woodpecker-kit/woodpecker-gitea-publisher-golang","icon":"https://raw.githubusercontent.com/woodpecker-kit/woodpecker-gitea-publisher-golang/main/doc/logo.svg","description":"Plugin to publish golang package to a Gitea Go Package Registry","docs":"<p>woodpecker-gitea-publisher-golang</p>\\n<p>plugin as <a href=\\"https://woodpecker-ci.org/\\">https://woodpecker-ci.org/</a> for <a href=\\"https://docs.gitea.com/usage/packages/go/\\">https://docs.gitea.com/usage/packages/go/</a> to publisher golang package</p>\\n<h2>Features</h2>\\n<ul>\\n<li><input type=\\"checkbox\\" disabled=\\"\\" checked=\\"\\"> push to <a href=\\"https://docs.gitea.com/usage/packages/go/\\">gitea Go Package Registry</a></li>\\n<li><input type=\\"checkbox\\" disabled=\\"\\" checked=\\"\\"> use TempDir to generate go mod zip file</li>\\n<li><input type=\\"checkbox\\" disabled=\\"\\" checked=\\"\\"> support dry-run mode</li>\\n<li><input type=\\"checkbox\\" disabled=\\"\\" checked=\\"\\"> auto get gitea base URL by <code>CI_FORGE_URL</code></li>\\n<li><input type=\\"checkbox\\" disabled=\\"\\" checked=\\"\\"> support <a href=\\"https://en.wikipedia.org/wiki/Monorepo\\">Monorepo</a><ul>\\n<li>use <code>settings.gitea-publish-golang-path-go</code> to publish dir go.mod one by one</li>\\n</ul>\\n</li>\\n<li><input type=\\"checkbox\\" disabled=\\"\\" checked=\\"\\"> out publish info json file default <code>dist/go-mod-upload.json</code><ul>\\n<li>use <code>settings.gitea-publish-golang-update-result-root-path</code> to change out root path, default <code>dist</code></li>\\n<li>use <code>settings.gitea-publish-golang-update-result-file-name</code> to change out file name, default <code>go-mod-upload.json</code></li>\\n</ul>\\n</li>\\n</ul>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Name</th>\\n<th>Required</th>\\n<th>Default value</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>debug</code></td>\\n<td><strong>no</strong></td>\\n<td><em>false</em></td>\\n<td>open debug log or open by env <code>PLUGIN_DEBUG</code></td>\\n</tr>\\n<tr>\\n<td><code>gitea-publish-golang-api-key</code></td>\\n<td><strong>yes</strong></td>\\n<td></td>\\n<td>gitea api key, Required</td>\\n</tr>\\n<tr>\\n<td><code>gitea-publish-golang-base-url</code></td>\\n<td><strong>no</strong></td>\\n<td></td>\\n<td>gitea base url, default by <code>CI_FORGE_URL</code></td>\\n</tr>\\n<tr>\\n<td><code>gitea-publish-golang-insecure</code></td>\\n<td><strong>no</strong></td>\\n<td><em>false</em></td>\\n<td>gitea insecure enable</td>\\n</tr>\\n<tr>\\n<td><code>gitea-publish-golang-dry-run</code></td>\\n<td><strong>no</strong></td>\\n<td><em>false</em></td>\\n<td>dry run mode</td>\\n</tr>\\n<tr>\\n<td><code>gitea-release-exists-do</code></td>\\n<td><strong>no</strong></td>\\n<td><em>fail</em></td>\\n<td>package release exists do, support <code>[fail skip overwrite]</code> ,{version 1.2+} (default: \\"fail\\")</td>\\n</tr>\\n<tr>\\n<td><code>gitea-publish-golang-path-go</code></td>\\n<td><strong>no</strong></td>\\n<td>\\"\\"</td>\\n<td>publish go package is dir to find go.mod, will append project root path, default is this project root path</td>\\n</tr>\\n<tr>\\n<td><code>gitea-publish-golang-remove-paths</code></td>\\n<td><strong>no</strong></td>\\n<td><code>[\\"dist\\"]</code></td>\\n<td>publish go package remove paths, this path under <code>gitea-publish-golang-path-go</code>, default will remove <code>dist</code></td>\\n</tr>\\n<tr>\\n<td><code>gitea-publish-golang-update-result-root-path</code></td>\\n<td><strong>no</strong></td>\\n<td><em>dist</em></td>\\n<td>out result root path append CI Workspace, default <code>dist</code></td>\\n</tr>\\n<tr>\\n<td><code>gitea-publish-golang-update-result-file-name</code></td>\\n<td><strong>no</strong></td>\\n<td><em>go-mod-upload.json</em></td>\\n<td>out file name, default <code>go-mod-upload.json</code></td>\\n</tr>\\n</tbody></table>\\n<p><strong>Hide Settings:</strong></p>\\n<table>\\n<thead>\\n<tr>\\n<th>Name</th>\\n<th>Required</th>\\n<th>Default value</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>timeout_second</code></td>\\n<td><strong>no</strong></td>\\n<td><em>10</em></td>\\n<td>command timeout setting by second</td>\\n</tr>\\n<tr>\\n<td><code>gitea-publish-golang-timeout-second</code></td>\\n<td><strong>no</strong></td>\\n<td><em>60</em></td>\\n<td>gitea release api timeout second, default 60, less 30</td>\\n</tr>\\n<tr>\\n<td><code>woodpecker-kit-steps-transfer-file-path</code></td>\\n<td><strong>no</strong></td>\\n<td><code>.woodpecker_kit.steps.transfer</code></td>\\n<td>Steps transfer file path, default by <code>wd_steps_transfer.DefaultKitStepsFileName</code></td>\\n</tr>\\n<tr>\\n<td><code>woodpecker-kit-steps-transfer-disable-out</code></td>\\n<td><strong>no</strong></td>\\n<td><em>false</em></td>\\n<td>Steps transfer write disable out</td>\\n</tr>\\n</tbody></table>\\n<h2>Example</h2>\\n<ul>\\n<li>workflow with backend <code>docker</code></li>\\n</ul>\\n<p><a href=\\"https://hub.docker.com/r/sinlov/woodpecker-gitea-publisher-golang/tags?page=1&amp;ordering=last_updated\\"><img alt=\\"docker hub version semver\\" src=\\"https://img.shields.io/docker/v/sinlov/woodpecker-gitea-publisher-golang?sort=semver\\"></a>\\n<a href=\\"https://hub.docker.com/r/sinlov/woodpecker-gitea-publisher-golang\\"><img alt=\\"docker hub image size\\" src=\\"https://img.shields.io/docker/image-size/sinlov/woodpecker-gitea-publisher-golang\\"></a>\\n<a href=\\"https://hub.docker.com/r/sinlov/woodpecker-gitea-publisher-golang/tags?page=1&amp;ordering=last_updated\\"><img alt=\\"docker hub image pulls\\" src=\\"https://img.shields.io/docker/pulls/sinlov/woodpecker-gitea-publisher-golang\\"></a></p>\\n<pre><code class=\\"language-yml\\">labels:\\n  backend: docker\\nsteps:\\n  woodpecker-gitea-publisher-golang:\\n    image: sinlov/woodpecker-gitea-publisher-golang:latest\\n    pull: false\\n    settings:\\n      # debug: true\\n      # gitea-publish-golang-dry-run: true # dry run mode\\n      gitea-publish-golang-api-key: # gitea api key, Required\\n        from_secret: gitea_api_key_release\\n      gitea-release-exists-do: \\"fail\\" # support [fail skip overwrite] (default: \\"fail\\") {version 1.2+}\\n      gitea-publish-golang-path-go: \\"\\" # publish go package is dir to find go.mod, will append project root path, default is this project root path\\n      gitea-publish-golang-remove-paths: # publish go package remove paths, this path under `gitea-publish-golang-path-go`, default will remove `dist`\\n        - \\"dist\\"\\n      # gitea-publish-golang-update-result-root-path: \\"dist\\" # out result root path append CI Workspace, default `dist`\\n      # gitea-publish-golang-update-result-file-name: \\"go-mod-upload.json\\" # out file name, default `go-mod-upload.json`\\n</code></pre>\\n<ul>\\n<li>workflow with backend <code>local</code>, must install at local and effective at evn <code>PATH</code><ul>\\n<li>can download by <a href=\\"https://github.com/woodpecker-kit/woodpecker-gitea-publisher-golang/releases\\">github release</a></li>\\n</ul>\\n</li>\\n<li>install at ${GOPATH}/bin, latest</li>\\n</ul>\\n<pre><code class=\\"language-bash\\">go install -a github.com/woodpecker-kit/woodpecker-gitea-publisher-golang/cmd/woodpecker-gitea-publisher-golang@latest\\n</code></pre>\\n<p><a href=\\"https://github.com/woodpecker-kit/woodpecker-gitea-publisher-golang/tags\\"><img alt=\\"GitHub latest SemVer tag)\\" src=\\"https://img.shields.io/github/v/tag/woodpecker-kit/woodpecker-gitea-publisher-golang\\"></a>\\n<a href=\\"https://github.com/woodpecker-kit/woodpecker-gitea-publisher-golang/releases\\"><img alt=\\"GitHub release)\\" src=\\"https://img.shields.io/github/v/release/woodpecker-kit/woodpecker-gitea-publisher-golang\\"></a></p>\\n<ul>\\n<li>install at ${GOPATH}/bin, v1.0.0</li>\\n</ul>\\n<pre><code class=\\"language-bash\\">go install -v github.com/woodpecker-kit/woodpecker-gitea-publisher-golang/cmd/woodpecker-gitea-publisher-golang@v1.0.0\\n</code></pre>\\n<pre><code class=\\"language-yml\\">labels:\\n  backend: local\\nsteps:\\n  woodpecker-gitea-publisher-golang:\\n    image: woodpecker-gitea-publisher-golang\\n    settings:\\n      # debug: true\\n      # gitea-publish-golang-dry-run: true # dry run mode\\n      gitea-publish-golang-api-key: # gitea api key, Required\\n        from_secret: gitea_api_key_release\\n      gitea-release-exists-do: \\"fail\\" # support [fail skip overwrite] (default: \\"fail\\") {version 1.2+}\\n      gitea-publish-golang-path-go: \\"\\" # publish go package is dir to find go.mod, will append project root path, default is this project root path\\n      gitea-publish-golang-remove-paths: # publish go package remove paths, this path under `gitea-publish-golang-path-go`, default will remove `dist`\\n        - \\"dist\\"\\n      # gitea-publish-golang-update-result-root-path: \\"dist\\" # out result root path append CI Workspace, default `dist`\\n      # gitea-publish-golang-update-result-file-name: \\"go-mod-upload.json\\" # out file name, default `go-mod-upload.json`\\n</code></pre>\\n<ul>\\n<li>full config</li>\\n</ul>\\n<pre><code class=\\"language-yaml\\">labels:\\n  backend: docker\\nsteps:\\n  woodpecker-gitea-publisher-golang:\\n    image: sinlov/woodpecker-gitea-publisher-golang:latest\\n    pull: false\\n    settings:\\n      debug: true\\n      gitea-publish-golang-dry-run: true # dry run mode\\n      gitea-publish-golang-timeout-second: 120 # gitea release api timeout second, default 60, less 30 \\n      gitea-publish-golang-api-key: # gitea api key, Required\\n        from_secret: gitea_api_key_release\\n      gitea-publish-golang-base-url: \\"https://gitea.example.com\\" # default by CI_FORGE_URL auto to find\\n      gitea-publish-golang-insecure: true #  gitea insecure enable\\n      gitea-release-exists-do: \\"fail\\" # support [fail skip overwrite] (default: \\"fail\\") {version 1.2+}\\n      gitea-publish-golang-path-go: \\"sub-go\\" # publish go package is dir to find go.mod, will append project root path, default is this project root path\\n      gitea-publish-golang-remove-paths: # publish go package remove paths, this path under `gitea-publish-golang-path-go`, default will remove `dist`\\n        - \\"dist\\"\\n      gitea-publish-golang-update-result-root-path: \\"dist\\" # out result root path append CI Workspace, default `dist`\\n      gitea-publish-golang-update-result-file-name: \\"go-mod-upload.json\\" # out file name, default `go-mod-upload.json`\\n</code></pre>\\n<h2>Notes</h2>\\n<ul>\\n<li>go mod zip file will generate by TempDir and try to remove after publish</li>\\n<li>template dir path graph <code>tempDir/woodpecker-gitea-publisher-golang/{repo-hostname}/{owner}/{repo}/{build_number}</code></li>\\n</ul>\\n<h2>Known limitations</h2>\\n<ol>\\n<li>go mod zip file generate by <code>zip.CreateFromDir</code>, this method will check\\nas <a href=\\"https://semver.org/\\">https://semver.org/</a>, so this kit use <code>CI_COMMIT_TAG</code> to generate version</li>\\n<li>open <code>gitea-publish-golang-dry-run</code> mode can pass all check, but not publish to gitea</li>\\n<li>but without event tag will use version mark as <code>latest</code>, this will not pass <code>zip.CreateFromDir</code>check, so will not\\npublish to gitea</li>\\n</ol>\\n","tags":["Gitea","publish-golang"],"author":"sinlov","containerImage":"sinlov/woodpecker-gitea-publisher-golang","containerImageUrl":"https://hub.docker.com/r/sinlov/woodpecker-gitea-publisher-golang","verified":false,"iconDataUrl":"data:image/svg+xml;base64,"},{"name":"Git Push","slug":"git-push","url":"https://github.com/appleboy/drone-git-push","icon":"https://raw.githubusercontent.com/appleboy/drone-git-push/master/images/logo.svg","description":"Commit and push to an git repo via SSH","docs":"<p>Use this plugin for commit and push an git repo.\\nYou will need to supply Drone / Woodpecker with a private SSH key or use the same credentials as the cloned repo to being able to push changes.</p>\\n<pre><code class=\\"language-yaml\\">- name: push commit\\n  image: appleboy/drone-git-push\\n  settings:\\n    branch: master\\n    remote: ssh://git@git.heroku.com/falling-wind-1624.git\\n    force: false\\n    commit: true\\n</code></pre>\\n<p>An example of pushing a branch back to the current repository:</p>\\n<pre><code class=\\"language-yaml\\">- name: push commit\\n  image: appleboy/drone-git-push\\n  settings:\\n    remote_name: origin\\n    branch: gh-pages\\n    local_ref: gh-pages\\n</code></pre>\\n<p>An example of specifying the path to a repo:</p>\\n<pre><code class=\\"language-yaml\\">- name: push commit\\n  image: appleboy/drone-git-push\\n  settings:\\n    remote_name: origin\\n    branch: gh-pages\\n    local_ref: gh-pages\\n    path: path/to/repo\\n</code></pre>\\n<h2>Parameter Reference</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>setting</th>\\n<th>description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td>ssh_key</td>\\n<td>private SSH key for the remote machine (make sure it ends with a newline)</td>\\n</tr>\\n<tr>\\n<td>remote</td>\\n<td>target remote repository (if blank, assume exists)</td>\\n</tr>\\n<tr>\\n<td>remote_name</td>\\n<td>name of the remote to use locally (default \\"deploy\\")</td>\\n</tr>\\n<tr>\\n<td>branch</td>\\n<td>target remote branch, defaults to master</td>\\n</tr>\\n<tr>\\n<td>local_branch</td>\\n<td>local branch or ref to push (default \\"HEAD\\")</td>\\n</tr>\\n<tr>\\n<td>path</td>\\n<td>path to git repo (if blank, assume current directory)</td>\\n</tr>\\n<tr>\\n<td>force</td>\\n<td>force push using the <code>--force</code> flag, defaults to false</td>\\n</tr>\\n<tr>\\n<td>skip_verify</td>\\n<td>skip verification of HTTPS certs, defaults to false</td>\\n</tr>\\n<tr>\\n<td>commit</td>\\n<td>add and commit the contents of the repo before pushing, defaults to false</td>\\n</tr>\\n<tr>\\n<td>commit_message</td>\\n<td>add a custom message for commit, if it is omitted, it will be <code>[skip ci] Commit dirty state</code></td>\\n</tr>\\n<tr>\\n<td>empty_commit</td>\\n<td>if you only want generate an empty commit, you can do it using this option</td>\\n</tr>\\n<tr>\\n<td>tag</td>\\n<td>if you want to add a tag to the commit, you can do it using this option. You must also set <code>followtags</code> to <code>true</code> if you want the tag to be pushed to the remote</td>\\n</tr>\\n<tr>\\n<td>author_name</td>\\n<td>the name to use for the author of the commit (if blank, assume push commiter name)</td>\\n</tr>\\n<tr>\\n<td>author_email</td>\\n<td>the email address to use for the author of the commit (if blank, assume push commiter name)</td>\\n</tr>\\n<tr>\\n<td>followtags</td>\\n<td>push with --follow-tags option</td>\\n</tr>\\n<tr>\\n<td>rebase</td>\\n<td>pull --rebase before pushing</td>\\n</tr>\\n</tbody></table>\\n","tags":["deploy","publish","git-push"],"author":"appleboy","containerImage":"appleboy/drone-git-push","containerImageUrl":"https://hub.docker.com/r/appleboy/drone-git-push","verified":false,"iconDataUrl":"data:image/svg+xml;base64,"},{"name":"WebDAV","slug":"webdav","url":"https://github.com/vividboarder/drone-webdav","description":"plugin to publish any artifacts to any WebDAV server","docs":"<p>A <a href=\\"https://www.drone.io/\\">Drone CI</a> / <a href=\\"https://woodpecker-ci.org/\\">Woodpecker CI</a> plugin,\\nthat will allow pushing build artifacts to any <a href=\\"http://www.webdav.org/\\">WebDAV</a> server, including Nextcloud or ownCloud.</p>\\n<h2>Features</h2>\\n<ul>\\n<li>Upload multiple files</li>\\n<li>Use a proxy</li>\\n<li>Retry on fail</li>\\n</ul>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings Name</th>\\n<th>Required</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>file</code></td>\\n<td><strong>\u2713</strong></td>\\n<td>File(s) to upload. Use <a href=\\"https://curl.se/docs/manpage.html#-T\\">curl syntax</a> for multiple (e.g. <code>{dogs.png,cats.jpg}</code>)</td>\\n</tr>\\n<tr>\\n<td><code>destination</code></td>\\n<td><strong>\u2713</strong></td>\\n<td>The WebDav <strong>folder</strong> url</td>\\n</tr>\\n<tr>\\n<td><code>username</code></td>\\n<td><strong>\u2713</strong></td>\\n<td>The WebDav-<strong>User</strong> to use</td>\\n</tr>\\n<tr>\\n<td><code>password</code></td>\\n<td></td>\\n<td>The <strong>Password</strong> for the WebDav-User</td>\\n</tr>\\n<tr>\\n<td><code>proxy_url</code></td>\\n<td></td>\\n<td>May be used to specify a proxy (e.g. <code>socks5://{ip_address}:{port}</code></td>\\n</tr>\\n<tr>\\n<td><code>timeout</code></td>\\n<td></td>\\n<td>Defines a timeout (in seconds) to stop the upload after a certain time</td>\\n</tr>\\n<tr>\\n<td><code>attempts</code></td>\\n<td></td>\\n<td>Defines how often a failed upload should be retried. Normally there is only one upload attempt</td>\\n</tr>\\n<tr>\\n<td><code>custom_arguments</code></td>\\n<td></td>\\n<td>Additional arguments to be passed to <a href=\\"https://curl.se/\\"><code>curl</code></a></td>\\n</tr>\\n</tbody></table>\\n<h2>Example</h2>\\n<pre><code class=\\"language-yaml\\">pipeline:\\n  upload_debug:\\n    image: vividboarder/drone-webdav\\n    settings:\\n      file: com.vividboarder.otbeta/build/outputs/apk/com.vividboarder.otbeta-debug.apk\\n      destination: https://my.nextcloud.com/remote.php/dav/files/vividboarder/Android/Apks/\\n      username:\\n        from_secret: WEBDAV_USER\\n      password:\\n        from_secret: WEBDAV_PASSWORD\\n</code></pre>\\n","tags":["deploy","publish"],"author":"vividboarder","containerImage":"vividboarder/drone-webdav","containerImageUrl":"https://hub.docker.com/r/vividboarder/drone-webdav","verified":false},{"name":"Aptly","slug":"aptly","url":"https://gitea.zionetrix.net/bn8/aptly-publish","icon":"https://www.aptly.info/img/logo.svg","description":"plugin to publish Debian package on a Aptly repository","docs":"<p>Woodpecker CI plugin to publish one (or more) Debian package on a Aptly repository using its API.</p>\\n<h2>Features</h2>\\n<p>This plugin will try to :</p>\\n<ul>\\n<li>List all changes files in the specified directory and filter on the specified source package name (if specified)</li>\\n<li>Iter on detected changes files and foreach of then:</li>\\n<li>the changes file is parsed to detect the source package name, the distribution and included files</li>\\n<li>the repository name is computed (if not specified). <strong>Format:</strong> <code>{prefix}_{distribution}_{component}</code>. <strong>Note:</strong> if the default prefix is specified (<code>.</code>), it will not be used to compute the repository name.</li>\\n<li>the current published distribution is retrieved using APTLY Publish API to:<ul>\\n<li>check it was already manally published a first time</li>\\n<li>check it used a snapshot kind of sources</li>\\n<li>retrieve other components source snapshot</li>\\n</ul>\\n</li>\\n<li>Upload the changes file and all its included files using APTLY File Upload API in a directory named as the source package</li>\\n<li>Include the changes file using APTLY Local Repos API</li>\\n<li>Compute a snapshot name for the repository based on the current date and the repository name. <strong>Format:</strong> <code>YYYYMMDD-HHMMSS_{repository name}</code></li>\\n<li>Create a snapshot of the repository using APTLY Local Repos API</li>\\n<li>Update the published distribution with this new snapshot as source of the specified component and keeping other components source snapshot.</li>\\n</ul>\\n<p>In case of error, it will exit with a detailed error message (within the limits of what is provided by the Aptly API).</p>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings Name</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>api_url</code></td>\\n<td><em>none</em></td>\\n<td>Your Aptly API URL (required)</td>\\n</tr>\\n<tr>\\n<td><code>api_username</code></td>\\n<td><em>none</em></td>\\n<td>Username to authenticate on your Aptly API (required)</td>\\n</tr>\\n<tr>\\n<td><code>api_password</code></td>\\n<td><em>none</em></td>\\n<td>Password to authenticate on your Aptly API (required)</td>\\n</tr>\\n<tr>\\n<td><code>prefix</code></td>\\n<td><code>.</code></td>\\n<td>The publishing prefix</td>\\n</tr>\\n<tr>\\n<td><code>repo_component</code></td>\\n<td><code>main</code></td>\\n<td>The component name to publish on</td>\\n</tr>\\n<tr>\\n<td><code>repo_name</code></td>\\n<td><code>{prefix}_{distribution}_{component}</code></td>\\n<td>The repository name to publish on. If not specified, it will be computed using the specified prefix and component and the detected package distribution. See above for details.</td>\\n</tr>\\n<tr>\\n<td><code>path</code></td>\\n<td><code>dist</code></td>\\n<td>Path to the directory where files to publish are stored</td>\\n</tr>\\n<tr>\\n<td><code>source_name</code></td>\\n<td><em>none</em></td>\\n<td>Name of the source package to publish (optional, default: all <code>changes</code> files are will be publish)</td>\\n</tr>\\n<tr>\\n<td><code>max_retries</code></td>\\n<td><em>none</em></td>\\n<td>The number of retry in case of error calling the Aptly API (optional, default: no retry)</td>\\n</tr>\\n</tbody></table>\\n<h2>Example</h2>\\n<pre><code class=\\"language-yaml\\">pipeline:\\n  publish:\\n    image: brenard/aptly-publish\\n    settings:\\n      api_url: https://your.aptly.tld/api\\n      api_username: myproject\\n      api_password:\\n        from_secret: aptly_api_password\\n      prefix: debian\\n      repo_component: main\\n      repo_name: debian_stable_main\\n      path: dist\\n      source_name: myproject\\n      max_retries: 2\\n</code></pre>\\n","tags":["APT","aptly","publish"],"author":"Benjamin Renard","containerImage":"brenard/aptly-publish","containerImageUrl":"https://hub.docker.com/r/brenard/aptly-publish","verified":false,"iconDataUrl":"data:image/svg+xml;base64,"},{"name":"Woodpecker Email","slug":"woodpecker-email","url":"https://gitnet.fr/deblan/woodpecker-email","icon":"https://gitnet.fr/deblan/woodpecker-email/raw/branch/develop/logo.svg","description":"plugin to send build status notifications via Email.","docs":"<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings Name</th>\\n<th>Required</th>\\n<th>Type</th>\\n<th>Description</th>\\n<th>Documentation</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td>dsn</td>\\n<td>yes</td>\\n<td><code>string</code></td>\\n<td>Mail transport configuration</td>\\n<td><a href=\\"https://symfony.com/doc/current/mailer.html#tls-peer-verification\\">Documentation</a></td>\\n</tr>\\n<tr>\\n<td>from.address</td>\\n<td>yes</td>\\n<td><code>string</code></td>\\n<td>Email address of the sender</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td>from.name</td>\\n<td>no</td>\\n<td><code>string</code></td>\\n<td>Name of the sender</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td>recipients</td>\\n<td>no</td>\\n<td><code>string</code> or <code>list</code></td>\\n<td>List of recipients to send this mail to (besides the commit author)</td>\\n<td>YAML list or comma separated list</td>\\n</tr>\\n<tr>\\n<td>recipients_only</td>\\n<td>no</td>\\n<td><code>boolean</code></td>\\n<td>Exclude the committer (default: <code>false</code>)</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td>content.subject</td>\\n<td>no</td>\\n<td><code>string</code></td>\\n<td>Define the email subject template</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td>content.body</td>\\n<td>no</td>\\n<td><code>string</code></td>\\n<td>Define the email body template</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td>attachments</td>\\n<td>no</td>\\n<td><code>string</code> or <code>list</code></td>\\n<td>List of files to attach</td>\\n<td>YAML list or comma separated list</td>\\n</tr>\\n<tr>\\n<td>debug</td>\\n<td>no</td>\\n<td><code>boolean</code></td>\\n<td>Debug mode (email are sent!, default: <code>false</code>)</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td>level</td>\\n<td>no</td>\\n<td><code>string</code></td>\\n<td>Define the level of the mail (default: <code>info</code>, values: <code>info</code>, <code>success</code>, <code>warning</code>, <code>failure</code>)</td>\\n<td></td>\\n</tr>\\n</tbody></table>\\n<h3>Examples</h3>\\n<pre><code class=\\"language-yaml\\">steps:\\n  mail:\\n    image: deblan/woodpecker-email\\n    settings:\\n      dsn: \\"smtp://username:password@mail.example.com:587?verify_peer=1\\"\\n      from:\\n        address: \\"woodpecker@example.com\\"\\n        name: \\"Woodpecker\\"\\n      evaluate: \'commit.branch == \\"master\\"\'\\n      recipients:\\n        - dev1@example.com\\n        - dev2@example.com\\n      level: success\\n      recipients_only: false\\n      content:\\n        subject: \\"[{{ pipeline.status }}] {{ repo.full_name }} ({{ commit.branch }} - {{ commit.sha[0:8] }}\\"\\n        body: |\\n          {{ commit.sha }}&lt;br&gt;\\n          {{ pipeline.status }}&lt;br&gt;\\n          {{ commit.author_email }}&lt;br&gt;\\n      attachments:\\n        - log/*\\n</code></pre>\\n<pre><code class=\\"language-yaml\\">steps:\\n  mail:\\n    image: deblan/woodpecker-email\\n    settings:\\n       level: failure\\n       #&nbsp;...\\n    when:\\n      status:\\n        - failure\\n</code></pre>\\n<h3>Evaluation and content</h3>\\n<p>See the <a href=\\"https://twig.symfony.com/doc/3.x/\\">Twig documentation</a>.</p>\\n<table>\\n<thead>\\n<tr>\\n<th>Variable</th>\\n<th>Value</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>workspace</code></td>\\n<td><code>CI_WORKSPACE</code></td>\\n</tr>\\n<tr>\\n<td><code>repo.full_name</code></td>\\n<td><code>CI_REPO</code></td>\\n</tr>\\n<tr>\\n<td><code>repo.owner</code></td>\\n<td><code>CI_REPO_OWNER</code></td>\\n</tr>\\n<tr>\\n<td><code>repo.name</code></td>\\n<td><code>CI_REPO_NAME</code></td>\\n</tr>\\n<tr>\\n<td><code>repo.url</code></td>\\n<td><code>CI_REPO_URL</code></td>\\n</tr>\\n<tr>\\n<td><code>commit.sha</code></td>\\n<td><code>CI_COMMIT_SHA</code></td>\\n</tr>\\n<tr>\\n<td><code>commit.ref</code></td>\\n<td><code>CI_COMMIT_REF</code></td>\\n</tr>\\n<tr>\\n<td><code>commit.branch</code></td>\\n<td><code>CI_COMMIT_BRANCH</code></td>\\n</tr>\\n<tr>\\n<td><code>commit.source_branch</code></td>\\n<td><code>CI_COMMIT_SOURCE_BRANCH</code></td>\\n</tr>\\n<tr>\\n<td><code>commit.target_branch</code></td>\\n<td><code>CI_COMMIT_TARGET_BRANCH</code></td>\\n</tr>\\n<tr>\\n<td><code>commit.tag</code></td>\\n<td><code>CI_COMMIT_TAG</code></td>\\n</tr>\\n<tr>\\n<td><code>commit.pull_request</code></td>\\n<td><code>CI_COMMIT_PULL_REQUEST</code></td>\\n</tr>\\n<tr>\\n<td><code>commit.pull_request_labels</code></td>\\n<td><code>CI_COMMIT_PULL_REQUEST_LABELS</code></td>\\n</tr>\\n<tr>\\n<td><code>commit.message</code></td>\\n<td><code>CI_COMMIT_MESSAGE</code></td>\\n</tr>\\n<tr>\\n<td><code>commit.author</code></td>\\n<td><code>CI_COMMIT_AUTHOR</code></td>\\n</tr>\\n<tr>\\n<td><code>commit.author_email</code></td>\\n<td><code>CI_COMMIT_AUTHOR_EMAIL</code></td>\\n</tr>\\n<tr>\\n<td><code>commit.author_avatar</code></td>\\n<td><code>CI_COMMIT_AUTHOR_AVATAR</code></td>\\n</tr>\\n<tr>\\n<td><code>commit.prerelease</code></td>\\n<td><code>CI_COMMIT_PRERELEASE</code></td>\\n</tr>\\n<tr>\\n<td><code>prev_commit.sha</code></td>\\n<td><code>CI_PREV_COMMIT_SHA</code></td>\\n</tr>\\n<tr>\\n<td><code>prev_commit.ref</code></td>\\n<td><code>CI_PREV_COMMIT_REF</code></td>\\n</tr>\\n<tr>\\n<td><code>prev_commit.branch</code></td>\\n<td><code>CI_PREV_COMMIT_BRANCH</code></td>\\n</tr>\\n<tr>\\n<td><code>prev_commit.source_branch</code></td>\\n<td><code>CI_PREV_COMMIT_SOURCE_BRANCH</code></td>\\n</tr>\\n<tr>\\n<td><code>prev_commit.target_branch</code></td>\\n<td><code>CI_PREV_COMMIT_TARGET_BRANCH</code></td>\\n</tr>\\n<tr>\\n<td><code>prev_commit.message</code></td>\\n<td><code>CI_PREV_COMMIT_MESSAGE</code></td>\\n</tr>\\n<tr>\\n<td><code>prev_commit.author</code></td>\\n<td><code>CI_PREV_COMMIT_AUTHOR</code></td>\\n</tr>\\n<tr>\\n<td><code>prev_commit.author_email</code></td>\\n<td><code>CI_PREV_COMMIT_AUTHOR_EMAIL</code></td>\\n</tr>\\n<tr>\\n<td><code>prev_commit.author_avatar</code></td>\\n<td><code>CI_PREV_COMMIT_AUTHOR_AVATAR</code></td>\\n</tr>\\n<tr>\\n<td><code>prev_commit.url</code></td>\\n<td><code>CI_PREV_COMMIT_URL</code></td>\\n</tr>\\n<tr>\\n<td><code>pipeline.number</code></td>\\n<td><code>CI_PIPELINE_NUMBER</code></td>\\n</tr>\\n<tr>\\n<td><code>pipeline.parent</code></td>\\n<td><code>CI_PIPELINE_PARENT</code></td>\\n</tr>\\n<tr>\\n<td><code>pipeline.event</code></td>\\n<td><code>CI_PIPELINE_EVENT</code></td>\\n</tr>\\n<tr>\\n<td><code>pipeline.url</code></td>\\n<td><code>CI_PIPELINE_URL</code></td>\\n</tr>\\n<tr>\\n<td><code>pipeline.deploy_target</code></td>\\n<td><code>CI_PIPELINE_DEPLOY_TARGET</code></td>\\n</tr>\\n<tr>\\n<td><code>pipeline.created_at</code></td>\\n<td><code>CI_PIPELINE_CREATED</code></td>\\n</tr>\\n<tr>\\n<td><code>pipeline.stared_at</code></td>\\n<td><code>CI_PIPELINE_STARTED</code></td>\\n</tr>\\n<tr>\\n<td><code>prev_pipeline.number</code></td>\\n<td><code>CI_PREV_PIPELINE_NUMBER</code></td>\\n</tr>\\n<tr>\\n<td><code>prev_pipeline.parent</code></td>\\n<td><code>CI_PREV_PIPELINE_PARENT</code></td>\\n</tr>\\n<tr>\\n<td><code>prev_pipeline.event</code></td>\\n<td><code>CI_PREV_PIPELINE_EVENT</code></td>\\n</tr>\\n<tr>\\n<td><code>prev_pipeline.url</code></td>\\n<td><code>CI_PREV_PIPELINE_URL</code></td>\\n</tr>\\n<tr>\\n<td><code>prev_pipeline.deploy_target</code></td>\\n<td><code>CI_PREV_PIPELINE_DEPLOY_TARGET</code></td>\\n</tr>\\n<tr>\\n<td><code>prev_pipeline.status</code></td>\\n<td><code>CI_PREV_PIPELINE_STATUS</code></td>\\n</tr>\\n<tr>\\n<td><code>prev_pipeline.created_at</code></td>\\n<td><code>CI_PREV_PIPELINE_CREATED</code></td>\\n</tr>\\n<tr>\\n<td><code>prev_pipeline.stared_at</code></td>\\n<td><code>CI_PREV_PIPELINE_STARTED</code></td>\\n</tr>\\n<tr>\\n<td><code>prev_pipeline.finished_at</code></td>\\n<td><code>CI_PREV_PIPELINE_FINISHED</code></td>\\n</tr>\\n<tr>\\n<td><code>workflow.name</code></td>\\n<td><code>WORKFLOW_NAME</code></td>\\n</tr>\\n<tr>\\n<td><code>step.name</code></td>\\n<td><code>CI_STEP_NAME</code></td>\\n</tr>\\n<tr>\\n<td><code>step.number</code></td>\\n<td><code>CI_STEP_NUMBER</code></td>\\n</tr>\\n<tr>\\n<td><code>step.start_at</code></td>\\n<td><code>CI_STEP_STARTED</code></td>\\n</tr>\\n<tr>\\n<td><code>step.url</code></td>\\n<td><code>CI_STEP_URL</code></td>\\n</tr>\\n</tbody></table>\\n","tags":["notifications","email"],"author":"Simon Vieille","containerImage":"deblan/woodpecker-email","containerImageUrl":"https://hub.docker.com/r/deblan/woodpecker-email","verified":false,"iconDataUrl":"data:image/svg+xml;base64,"},{"name":"Woodpecker Feishu Bot","slug":"woodpecker-feishu-bot","url":"https://github.com/wenerme/woodpecker-feishu-bot","description":"Send notify to feishu/\u98DE\u4E66 in text or markdown format","docs":"<h2>Example</h2>\\n<pre><code class=\\"language-yaml\\">variables:\\n  - &amp;notify_image \'wener/woodpecker-feishu-bot\'\\n\\npipeline:\\n  Notify Start:\\n    image: *notify_image\\n    settings:\\n      feishu_bot_url:\\n        from_secret: feishu_bot_url\\n      feishu_bot_secret:\\n        from_secret: feishu_bot_secret\\n      markdown: |\\n        \uD83C\uDFD7\uFE0F Start building &lt;%= env.CI_REPO_NAME %&gt; #&lt;%= env.CI_BUILD_NUMBER %&gt;\\n\\n        - &lt;%= $.link(env.CI_COMMIT,env.CI_COMMIT_LINK) %&gt; &lt;%=env.CI_COMMIT_MESSAGE.replaceAll(/\\\\n/g,\';\')%&gt;\\n\\n        \uD83D\uDCE6\uFE0F &lt;%=$.link(env.CI_REPO_NAME,env.CI_BUILD_LINK)%&gt;\\n\\n  # Do the real work\\n\\n  Notify Done:\\n    image: *notify_image\\n    settings:\\n      feishu_bot_url:\\n        from_secret: feishu_bot_url\\n      feishu_bot_secret:\\n        from_secret: feishu_bot_secret\\n      markdown: |\\n        &lt;%= env.CI_PIPELINE_STATUS === \'success\' ? \'\u2705\' : \'\u274C\' %&gt; Building complete &lt;%= env.CI_REPO_NAME %&gt; #&lt;%= env.CI_BUILD_NUMBER %&gt;\\n\\n        - &lt;%= env.CI_COMMIT_MESSAGE %&gt;\\n\\n        \uD83D\uDCE6\uFE0F &lt;%= $.link(env.CI_REPO_NAME, env.CI_BUILD_LINK) %&gt; \xb7 \u23F3&lt;%= env.CI_PIPELINE_FINISHED - env.CI_PIPELINE_STARTED %&gt;\\n    when:\\n      status: [ success, failure ]\\n</code></pre>\\n<h2>settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>setting</th>\\n<th>for</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td>feisbu_bot_url</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td>feisbu_bot_secret</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td>content</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td>format</td>\\n<td>format of content, default to markdown</td>\\n</tr>\\n<tr>\\n<td>markdown</td>\\n<td>=content+format=markdown</td>\\n</tr>\\n<tr>\\n<td>text</td>\\n<td>=content+format=text</td>\\n</tr>\\n<tr>\\n<td>dry_run</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td>debug</td>\\n<td>print env</td>\\n</tr>\\n<tr>\\n<td>template</td>\\n<td>render as eta template, default to true</td>\\n</tr>\\n<tr>\\n<td>failsafe</td>\\n<td>if true, ignore error</td>\\n</tr>\\n</tbody></table>\\n<ul>\\n<li>eta template context<ul>\\n<li>env -&gt; process.env</li>\\n<li>fs -&gt; fs-extra</li>\\n</ul>\\n</li>\\n</ul>\\n","tags":["notify"],"author":"Wener","containerImage":"wener/woodpecker-feishu-bot","containerImageUrl":"https://hub.docker.com/r/wener/woodpecker-feishu-bot","verified":false},{"name":"Nextcloud Upload","slug":"nextcloud-upload","url":"https://github.com/Ellpeck/WoodpeckerPlugins/tree/main/nextcloud-upload","description":"Upload files to Nextcloud using chunking and optionally add tags to files","docs":"<h1>Nextcloud Upload</h1>\\n<p>Simple plugin to upload files to Nextcloud using chunking, based on a glob pattern and a destination location. Note that, since this uses Nextcloud\'s built-in chunking system, it likely doesn\'t work for other WebDAV applications.</p>\\n<p>Here\'s an example of how to use it:</p>\\n<pre><code class=\\"language-yml\\">steps:\\n  upload:\\n    image: ellpeck/woodpecker-nextcloud-upload\\n    settings:\\n      # required settings\\n      server: https://cloud.ellpeck.de # the server to use\\n      user: EllBot # the user\\n      token: access-token # the access token, or password if 2FA is disabled\\n      files: # the file(s), uses glob patterns\\n        - \\"**/*.md\\"\\n      dest: Uploads/CoolMarkdownFiles # the destination directory\\n\\n      # optional retention settings, useful if old builds should be deleted automatically\\n      retentionamount: 7 # amount of children that retentionbase is allowed to have before oldest ones are deleted on upload\\n      retentionbase: Uploads # directory that the retentionamount applies to\\n      retentionskiptrash: false # whether retention-based deletion should skip the Nextcloud trash, defaults to false\\n\\n      # misc optional settings\\n      basedir: \\".\\" # local base directory for files, defaults to .\\n      chunksize: # chunk size in bytes, defaults to 10485760, or 10 MiB\\n      quiet: false # whether to reduce output, defaults to false\\n      tags: # a set of tags to apply to uploaded files, tag is expected to already exist\\n        - mytag\\n      flatten: false # whether to flatten directories, causing all files to be placed directly in dest, defaults to false\\n</code></pre>\\n","tags":["deploy","publish"],"author":"Ellpeck","containerImage":"ellpeck/woodpecker-nextcloud-upload","containerImageUrl":"https://hub.docker.com/r/ellpeck/woodpecker-nextcloud-upload","verified":false},{"name":"Kubernetes Deployment or StatefulSet Update","slug":"kubernetes-deployment-or-statefulset-update","url":"https://github.com/euryecetelecom/woodpeckerci-kubernetes","description":"Update a Kubernetes deployment or statefulset","docs":"<h1>Kubernetes plugin for Woodpecker-CI</h1>\\n<p>This plugin allows to update a Kubernetes deployment or statefulset.</p>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Setting Name</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>kubernetes_server</code></td>\\n<td><em>none</em></td>\\n<td>Kubernetes server to target (ex: <a href=\\"https://mykubernetes.example.com\\">https://mykubernetes.example.com</a>) - mandatory</td>\\n</tr>\\n<tr>\\n<td><code>kubernetes_token</code></td>\\n<td><em>none</em></td>\\n<td>Kubernetes token to use (cf Generating secrets) - mandatory / B64 encoded</td>\\n</tr>\\n<tr>\\n<td><code>kubernetes_cert</code></td>\\n<td><em>none</em></td>\\n<td>Kubernetes certificate to use (cf Generating secrets) / B64 encoded</td>\\n</tr>\\n<tr>\\n<td><code>kubernetes_user</code></td>\\n<td><code>default</code></td>\\n<td>Kubernetes user to use</td>\\n</tr>\\n<tr>\\n<td><code>deployment</code></td>\\n<td><em>none</em></td>\\n<td>Deployment(s) to update - at least 1 deployment or statefulset are mandatory</td>\\n</tr>\\n<tr>\\n<td><code>statefulset</code></td>\\n<td><em>none</em></td>\\n<td>StatefulSet(s) to update - at least 1 deployment or statefulset are mandatory</td>\\n</tr>\\n<tr>\\n<td><code>namespace</code></td>\\n<td><code>default</code></td>\\n<td>Deployment or StatefulSet namespace</td>\\n</tr>\\n<tr>\\n<td><code>repo</code></td>\\n<td><em>none</em></td>\\n<td>Repository containing the image to pull from (ex: myrepo.example.com/project/image) - mandatory</td>\\n</tr>\\n<tr>\\n<td><code>container</code></td>\\n<td><em>none</em></td>\\n<td>Container(s) to update with the image - mandatory</td>\\n</tr>\\n<tr>\\n<td><code>tag</code></td>\\n<td><em>none</em></td>\\n<td>Image tag to pull from - mandatory</td>\\n</tr>\\n<tr>\\n<td><code>wait</code></td>\\n<td><em>none</em></td>\\n<td>Wait for update to be applied (ex: true)</td>\\n</tr>\\n<tr>\\n<td><code>wait_timeout</code></td>\\n<td><code>30s</code></td>\\n<td>Wait timeout</td>\\n</tr>\\n<tr>\\n<td><code>force</code></td>\\n<td><em>none</em></td>\\n<td>Force pull the new image, to ensure an image with the same tag is updated (ex: true)</td>\\n</tr>\\n</tbody></table>\\n<h2>Usage</h2>\\n<h3>Update a container from one Deployment</h3>\\n<p>This pipeline will update the <code>my-deployment</code> deployment with the image tagged <code>CI_COMMIT_SHA</code></p>\\n<pre><code class=\\"language-yaml\\">    deploy:\\n        image: euryecetelecom/woodpeckerci-kubernetes\\n        settings:\\n            kubernetes_server:\\n                from_secret: kubernetes_server\\n            kubernetes_token:\\n                from_secret: kubernetes_token\\n            kubernetes_cert:\\n                from_secret: kubernetes_cert\\n            namespace: default\\n            deployment: my-deployment\\n            repo: myorg/myrepo\\n            container: my-container\\n            tag: ${CI_COMMIT_BRANCH}\\n        secrets:\\n            - kubernetes_cert\\n            - kubernetes_server\\n            - kubernetes_token\\n</code></pre>\\n<h3>Update a container from one StatefulSet</h3>\\n<p>This pipeline will update the <code>my-statefulset</code> statefulset with the image tagged <code>CI_COMMIT_SHA</code></p>\\n<pre><code class=\\"language-yaml\\">    deploy:\\n        image: euryecetelecom/woodpeckerci-kubernetes\\n        settings:\\n            kubernetes_server:\\n                from_secret: kubernetes_server\\n            kubernetes_token:\\n                from_secret: kubernetes_token\\n            kubernetes_cert:\\n                from_secret: kubernetes_cert\\n            namespace: default\\n            statefulset: my-statefulset\\n            repo: myorg/myrepo\\n            container: my-container\\n            tag: ${CI_COMMIT_BRANCH}\\n        secrets:\\n            - kubernetes_cert\\n            - kubernetes_server\\n            - kubernetes_token\\n</code></pre>\\n<h3>Update a container from one Deployment, force rollout and wait for it</h3>\\n<p>This pipeline will update the <code>my-deployment</code> deployment with the image tagged <code>CI_COMMIT_SHA</code>, force rollout and wait 300s (default is 30s) for it to be ready. This helps to ensure the next pipeline step is based on the deployed container - for automatic testing purposes for example.</p>\\n<pre><code class=\\"language-yaml\\">    deploy:\\n        image: euryecetelecom/woodpeckerci-kubernetes\\n        settings:\\n            kubernetes_server:\\n                from_secret: kubernetes_server\\n            kubernetes_token:\\n                from_secret: kubernetes_token\\n            kubernetes_cert:\\n                from_secret: kubernetes_cert\\n            namespace: default\\n            wait: true\\n            wait_timeout: 60s\\n            force: true\\n            deployment: my-deployment\\n            repo: myorg/myrepo\\n            container: my-container\\n            tag: ${CI_COMMIT_BRANCH}\\n        secrets:\\n            - kubernetes_cert\\n            - kubernetes_server\\n            - kubernetes_token\\n</code></pre>\\n<h3>Update a container from several Deployments</h3>\\n<p>Deploying containers across several deployments, eg in a scheduler-worker setup. Make sure your container <code>name</code> in your manifest is the same for each pod.</p>\\n<pre><code class=\\"language-yaml\\">    deploy:\\n        image: euryecetelecom/woodpeckerci-kubernetes\\n        settings:\\n            kubernetes_server:\\n                from_secret: kubernetes_server\\n            kubernetes_token:\\n                from_secret: kubernetes_token\\n            kubernetes_cert:\\n                from_secret: kubernetes_cert\\n            namespace: default\\n            deployment: [server-deploy, worker-deploy]\\n            repo: myorg/myrepo\\n            container: my-container\\n            tag: ${CI_COMMIT_BRANCH}\\n        secrets:\\n            - kubernetes_cert\\n            - kubernetes_server\\n            - kubernetes_token\\n</code></pre>\\n<h3>Update multiple container from a Deployment</h3>\\n<p>Deploying multiple containers within the same deployment.</p>\\n<pre><code class=\\"language-yaml\\">    deploy:\\n        image: euryecetelecom/woodpeckerci-kubernetes\\n        settings:\\n            kubernetes_server:\\n                from_secret: kubernetes_server\\n            kubernetes_token:\\n                from_secret: kubernetes_token\\n            kubernetes_cert:\\n                from_secret: kubernetes_cert\\n            namespace: default\\n            deployment: my-deployment\\n            repo: myorg/myrepo\\n            container: [container1, container2]\\n            tag: ${CI_COMMIT_BRANCH}\\n        secrets:\\n            - kubernetes_cert\\n            - kubernetes_server\\n            - kubernetes_token\\n</code></pre>\\n<h3>TODO: To be tested - multiple containers from multiple deployments</h3>\\n<h2>Required secrets</h2>\\n<pre><code class=\\"language-bash\\">    woodpecker-cli secret add --image=infras/woodpeckerci-kubernetes \\\\\\n        your-org/your-repo KUBERNETES_SERVER https://mykubernetesapiserver\\n\\n    woodpecker-cli secret add --image=infras/woodpeckerci-kubernetes \\\\\\n        your-org/your-repo KUBERNETES_CERT &lt;base64 encoded CA.crt&gt;\\n\\n    woodpecker-cli secret add --image=infras/woodpeckerci-kubernetes \\\\\\n        your-org/your-repo KUBERNETES_TOKEN eyJhbGciOiJSUzI1NiIsInR5cCI6IkpXVCJ9.eyJpc3MiOiJrdWJ...\\n</code></pre>\\n<p>When using TLS Verification, ensure Server Certificate used by kubernetes API server \\nis signed for SERVER url ( could be a reason for failures if using aliases of kubernetes cluster )</p>\\n<h2>Generating secrets - RBAC</h2>\\n<p>When using a version of kubernetes with RBAC (role-based access control)\\nenabled, you will not be able to use the default service account, since it does\\nnot have access to update deployments.  Instead, you will need to create a\\ncustom service account with the appropriate permissions (<code>Role</code> and <code>RoleBinding</code>, or <code>ClusterRole</code> and <code>ClusterRoleBinding</code> if you need access across namespaces using the same service account).</p>\\n<p>As an example (for the <code>default</code> namespace):</p>\\n<pre><code class=\\"language-yaml\\">apiVersion: v1\\nkind: ServiceAccount\\nmetadata:\\n  name: cicd-deploy\\n  namespace: default\\nautomountServiceAccountToken: true\\n\\n---\\n\\napiVersion: rbac.authorization.k8s.io/v1\\nkind: Role\\nmetadata:\\n  name: cicd-deploy\\n  namespace: default\\nrules:\\n  - apiGroups: [\\"apps\\"]\\n    resources: [\\"deployments\\"]\\n    verbs: [\\"get\\",\\"list\\",\\"patch\\",\\"update\\", \\"watch\\"]\\n\\n---\\n\\napiVersion: rbac.authorization.k8s.io/v1\\nkind: RoleBinding\\nmetadata:\\n  name: cicd-deploy\\n  namespace: default\\nsubjects:\\n  - kind: ServiceAccount\\n    name: cicd-deploy\\n    namespace: default\\nroleRef:\\n  kind: Role\\n  name: cicd-deploy\\n  apiGroup: rbac.authorization.k8s.io\\n\\n---\\n\\napiVersion: v1\\nkind: Secret\\nmetadata:\\n  name: cicd-deploy-secret\\n  namespace: default\\n  annotations:\\n    kubernetes.io/service-account.name: cicd-deploy\\ntype: kubernetes.io/service-account-token\\n</code></pre>\\n<p>Once the service account is created, you can extract the <code>ca.cert</code> and <code>token</code>\\nparameters as mentioned for the default service account above:</p>\\n<pre><code>kubectl -n default get secret/cicd-deploy-secret -o yaml | egrep \'ca.crt:|token:\'\\n</code></pre>\\n<h2>Improvements / Ideas</h2>\\n<p>Replace the current kubectl bash script with a go implementation.</p>\\n","tags":["deploy","kubernetes","deployment","container","statefulset"],"author":"EuryeceTelecom","containerImage":"euryecetelecom/woodpeckerci-kubernetes","containerImageUrl":"https://hub.docker.com/r/euryecetelecom/woodpeckerci-kubernetes","verified":false},{"name":"Dockle plugin for Woodpecker-CI","slug":"dockle-plugin-for-woodpecker-ci","url":"https://github.com/euryecetelecom/woodpeckerci-dockle","icon":"https://raw.githubusercontent.com/euryecetelecom/woodpeckerci-dockle/main/logo.png","description":"Scan containers with dockle","docs":"<h1>Dockle plugin for Woodpecker-CI</h1>\\n<p>Woodpecker-CI plugin to scan containers with dockle (Container Image Linter for Security, Helping build the Best-Practice Docker Image) <a href=\\"https://github.com/goodwithtech/dockle\\">https://github.com/goodwithtech/dockle</a>.</p>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings Name</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>exit-code</code></td>\\n<td><code>1</code></td>\\n<td>If an issue is detected let the step fail</td>\\n</tr>\\n<tr>\\n<td><code>exit-level</code></td>\\n<td><code>warn</code></td>\\n<td>Define alert levels (can be info, warn or fatal)</td>\\n</tr>\\n<tr>\\n<td><code>build-directory</code></td>\\n<td><code>${CI_WORKSPACE}</code></td>\\n<td>Directory containing the Dockerfile to use to build the container</td>\\n</tr>\\n<tr>\\n<td><code>dockerfile</code></td>\\n<td><code>Dockerfile</code></td>\\n<td>Dockerfile to use</td>\\n</tr>\\n<tr>\\n<td><code>dockle-ignores</code></td>\\n<td><em>none</em></td>\\n<td>Dockle rules to ignore (cf <a href=\\"https://github.com/goodwithtech/dockle/blob/master/CHECKPOINT.md\\">https://github.com/goodwithtech/dockle/blob/master/CHECKPOINT.md</a>)</td>\\n</tr>\\n</tbody></table>\\n<h2>Usage</h2>\\n<p>This container require privilegied capabilities to communicate with host docker daemon, like woodpeckerci/plugin-docker-buildx. Ensure the project configuration takes it in account (verified has to be enabled).</p>\\n<h3>Simple usage:</h3>\\n<pre><code class=\\"language-yml\\">pipeline:\\n  dockle_check:\\n    image: euryecetelecom/woodpeckerci-dockle\\n    volumes:\\n      - /var/run/docker.sock:/var/run/docker.sock\\n</code></pre>\\n<h3>Advanced usage:</h3>\\n<pre><code class=\\"language-yml\\">pipeline:\\n  dockle_check:\\n    image: euryecetelecom/woodpeckerci-dockle\\n    volumes:\\n      - /var/run/docker.sock:/var/run/docker.sock\\n    settings:\\n      dockerfile: MyCustomDockerfile\\n      build-directory: ./docker\\n      exit-code: 0\\n      exit-level: info\\n      dockle-ignores: CIS-DI-0001,DKL-DI-0006\\n</code></pre>\\n","tags":["check","security","dockle","vulnerabilities","misconfigurations","secrets"],"author":"EuryeceTelecom","containerImage":"euryecetelecom/woodpeckerci-dockle","containerImageUrl":"https://hub.docker.com/r/euryecetelecom/woodpeckerci-dockle","verified":false,"iconDataUrl":"data:image/png;base64,"},{"name":"Ready release go \uD83D\uDE80","slug":"ready-release-go","url":"https://github.com/woodpecker-ci/plugin-ready-release-go","description":"Plugin for semi-automated releases.","docs":"<h1>Introduction</h1>\\n<p>This plugin can be executed on every push to your release branch (e.g. default branch) and will create a new release pull-request with an updated changelog\\nas preparation for the next release.\\nAfter merging the \\"release\\"-pull-request, a new release / tag will be created for you.</p>\\n<p>A Woodpecker workflow file could look like this:</p>\\n<pre><code class=\\"language-yaml\\">steps:\\n  release-helper:\\n    image: woodpeckerci/plugin-ready-release-go\\n    settings:\\n      # release_branch: \'custom-release-branch\' # default: CI_REPO_DEFAULT_BRANCH\\n      git_email: &lt;email&gt;\\n      forge_token:\\n        from_secret: GITHUB_TOKEN\\n\\nwhen:\\n  event: push\\n  branch: ${CI_REPO_DEFAULT_BRANCH}\\n</code></pre>\\n<h2>Features</h2>\\n<ul>\\n<li>Create automated changelog based on PRs which updates itself after each merge to the default branch</li>\\n<li>Auto-categorization of PRs based on labels</li>\\n<li>Automatically determines the next semver version using the PR labels</li>\\n<li>Supports any kind of programming language, changelog tool and commit style</li>\\n<li>Allows to execute custom hooks like pre, post-release</li>\\n</ul>\\n<h2>Settings</h2>\\n<p>There are two parts to configure the plugin:</p>\\n<h3>1. Most basic options can be configured via plugin settings</h3>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>FORGE_TYPE</code></td>\\n<td>CI_FORGE_TYPE</td>\\n<td>The forge type we connect to (github, gitea, ...)</td>\\n</tr>\\n<tr>\\n<td><code>FORGE_URL</code></td>\\n<td>CI_FORGE_URL</td>\\n<td>The url of the forge</td>\\n</tr>\\n<tr>\\n<td><code>FORGE_TOKEN</code></td>\\n<td><em>none</em></td>\\n<td>The token to connect to the forge</td>\\n</tr>\\n<tr>\\n<td><code>GIT_EMAIL</code></td>\\n<td><em>none</em></td>\\n<td>The email to use for git commits</td>\\n</tr>\\n<tr>\\n<td><code>RELEASE_BRANCH</code></td>\\n<td>CI_REPO_DEFAULT_BRANCH</td>\\n<td>The branch used to merge the changelog to</td>\\n</tr>\\n<tr>\\n<td><code>PULL_REQUEST_BRANCH_PREFIX</code></td>\\n<td><code>next-release/</code></td>\\n<td>The prefix used for release pull-request branches</td>\\n</tr>\\n<tr>\\n<td><code>DEBUG</code></td>\\n<td><code>false</code></td>\\n<td>Enable debug logging</td>\\n</tr>\\n<tr>\\n<td><code>RELEASE_PREFIX</code></td>\\n<td>\uD83C\uDF89 Release</td>\\n<td>Prefix of the PR title</td>\\n</tr>\\n</tbody></table>\\n<h3>2. Using a <code>release-config.ts</code> file in your repository</h3>\\n<p>Add a <code>release-config.ts</code> file to the root of your repository. Have a look at the <a href=\\"https://github.com/woodpecker-ci/plugin-ready-release-go/blob/main/src/utils/types.ts\\">UserConfig</a> type for all available options.</p>\\n<pre><code class=\\"language-ts\\">export default {\\n  changeTypes: [\\n    {\\n      title: \'\uD83D\uDCA5 Breaking changes\',\\n      labels: [\'breaking\'],\\n      bump: \'major\',\\n      weight: 3,\\n    },\\n    {\\n      title: \'\uD83D\uDD12 Security\',\\n      labels: [\'security\'],\\n      bump: \'patch\',\\n      weight: 2,\\n    },\\n    {\\n      title: \'\u2728 Features\',\\n      labels: [\'feature\', \'feature \uD83D\uDE80\uFE0F\'],\\n      bump: \'minor\',\\n      weight: 1,\\n    },\\n    {\\n      title: \'\uD83D\uDCC8 Enhancement\',\\n      labels: [\'enhancement\', \'refactor\', \'enhancement \uD83D\uDC46\uFE0F\'],\\n      bump: \'minor\',\\n    },\\n    {\\n      title: \'\uD83D\uDC1B Bug Fixes\',\\n      labels: [\'bug\', \'bug \uD83D\uDC1B\uFE0F\'],\\n      bump: \'patch\',\\n    },\\n    {\\n      title: \'\uD83D\uDCDA Documentation\',\\n      labels: [\'docs\', \'documentation\', \'documentation \uD83D\uDCD6\uFE0F\'],\\n      bump: \'patch\',\\n    },\\n    {\\n      title: \'\uD83D\uDCE6\uFE0F Dependency\',\\n      labels: [\'dependency\', \'dependencies\'],\\n      bump: \'patch\',\\n      weight: -1,\\n    },\\n    {\\n      title: \'Misc\',\\n      labels: [\'misc\', \'chore \uD83E\uDDF0\'],\\n      bump: \'patch\',\\n      default: true,\\n      weight: -2,\\n    },\\n  ],\\n  skipLabels: [\'skip-release\', \'skip-changelog\', \'regression\'],\\n  skipCommitsWithoutPullRequest: true,\\n  commentOnReleasedPullRequests: false,\\n};\\n</code></pre>\\n<p>The plugin also supports executing custom hooks which can e.g. help to perform additional actions during a release (e.g. updating a helm chart\'s <code>appVersion</code> field):</p>\\n<pre><code class=\\"language-ts\\">export default {\\n  beforePrepare: async ({ exec, nextVersion }) =&gt; {\\n    await exec(`sed -i \\"s/^version:.*$/version: ${nextVersion}/g\\" Chart.yaml`);\\n  },\\n};\\n</code></pre>\\n","tags":["git","release"],"author":"Woodpecker Authors","containerImage":"woodpeckerci/plugin-ready-release-go","containerImageUrl":"https://hub.docker.com/r/woodpeckerci/plugin-ready-release-go","verified":true},{"name":"Nix - Attic","slug":"nix-attic","url":"https://git.vdx.hu/voidcontext/woodpecker-plugin-nix-attic","description":"Plugin for building and caching nix derivations using attic","docs":"<p>This Woodpecker CI plugin is to build and cache nix derivations using the binary cache\\n<a href=\\"https://github.com/zhaofengli/attic\\">attic</a>. The image is based on NixOS.</p>\\n<h2>Features</h2>\\n<ul>\\n<li>nix experimental features enabled by default: commands and flakes</li>\\n<li>preinstalled <a href=\\"https://github.com/zhaofengli/attic\\">attic-client</a></li>\\n</ul>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings Name</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>binary_cache</code></td>\\n<td><em>none</em></td>\\n<td>sets the URL of the binary cache</td>\\n</tr>\\n<tr>\\n<td><code>binary_cache_public_key</code></td>\\n<td><em>none</em></td>\\n<td>sets the public key of the binary cache</td>\\n</tr>\\n<tr>\\n<td><code>binary_cache_token</code></td>\\n<td><em>none</em></td>\\n<td>sets the access token of the binary cache</td>\\n</tr>\\n<tr>\\n<td><code>script</code></td>\\n<td><em>none</em></td>\\n<td>sets the commands / script to run</td>\\n</tr>\\n</tbody></table>\\n<h2>Example configuration</h2>\\n<pre><code class=\\"language-yaml\\">steps:\\n  check:\\n    image: harbor.vdx.hu/voidcontext/woodpecker-plugin-nix-attic:0.2.0\\n    settings:\\n      binary_cache: https://some-binary-cache.example.com\\n      binary_cache_public_key: some-binary-cache.example.com:some-public-key\\n      binary_cache_token:\\n        from_secret: binary_cache_access_token\\n      script: |\\n       nix flake check\\n       nix build\\n       attic login default $PLUGIN_BINARY_CACHE_TOKEN\\n       attic push some-cache $(nix path-info .#default)\\n</code></pre>\\n","tags":["woodpecker","nixos","nix","attic"],"author":"Gabor Pihaj <me@gaborpihaj.com>","containerImage":"harbor.vdx.hu/voidcontext/woodpecker-plugin-nix-attic","containerImageUrl":"https://harbor.vdx.hu/harbor/projects/2/repositories/woodpecker-plugin-nix-attic/artifacts-tab","verified":false},{"name":"Codeberg Pages Deploy","slug":"codeberg-pages-deploy","url":"https://codeberg.org/xfix/plugin-codeberg-pages-deploy","description":"Deploy project to Codeberg Pages","docs":"<h1>Codeberg Pages Deploy plugin for Woodpecker CI</h1>\\n<p>Codeberg Pages Deploy plugin automatically deploys a directory to <code>pages</code>\\nbranch.</p>\\n<h2>Usage</h2>\\n<p>To use the plugin add a step similar to this after creating a directory\\ncontaining static page contents.</p>\\n<pre><code class=\\"language-yaml\\">deploy:\\n  image: codeberg.org/xfix/plugin-codeberg-pages-deploy:1\\n  settings:\\n    folder: dist\\n    ssh_key:\\n      from_secret: ssh_key\\n</code></pre>\\n<p>Generate an SSH key using the following command.</p>\\n<pre><code class=\\"language-sh\\">ssh-keygen -t ed25519 -f /tmp/out\\n</code></pre>\\n<p>In Woodpecker CI settings, create a secret called <code>ssh_key</code> containing\\na private key stored in <code>/tmp/out</code> file.</p>\\n<p>In Codeberg repository settings, add a Deploy Key with Write Acccess using\\na public key stored in <code>/tmp/out.pub</code> file.</p>\\n<h2>Configuration</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Key</th>\\n<th>Information</th>\\n<th>Required</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>folder</code></td>\\n<td>Directory containing static page contents.</td>\\n<td>Yes</td>\\n</tr>\\n<tr>\\n<td><code>ssh_key</code></td>\\n<td>SSH deploy key, usually passed as a secret.</td>\\n<td>Yes</td>\\n</tr>\\n<tr>\\n<td><code>repository_name</code></td>\\n<td>Repository name to deploy to, if not specified it will deploy to the repository the workflow is running from.</td>\\n<td>No</td>\\n</tr>\\n<tr>\\n<td><code>branch</code></td>\\n<td>Branch to deploy to. Defaults to <code>pages</code>.</td>\\n<td>No</td>\\n</tr>\\n<tr>\\n<td><code>git_config_name</code></td>\\n<td>Customizes the name that is attached to the deployment commit, defaults to commit author username.</td>\\n<td>No</td>\\n</tr>\\n<tr>\\n<td><code>git_config_email</code></td>\\n<td>Customizes the email that is attached to the deployment commit, defaults to commit author email address.</td>\\n<td>No</td>\\n</tr>\\n</tbody></table>\\n","tags":["deploy","publish","codeberg"],"author":"Kamila Borowska","containerImage":"codeberg.org/xfix/plugin-codeberg-pages-deploy","containerImageUrl":"https://codeberg.org/xfix/-/packages/container/plugin-codeberg-pages-deploy/latest","verified":false},{"name":"Reviewdog golangci-lint","slug":"reviewdog-golangci-lint","url":"https://codeberg.org/woodpecker-plugins/reviewdog-golangci-lint","icon":"https://codeberg.org/woodpecker-plugins/reviewdog-golangci-lint/media/branch/main/logo.png","description":"plugin to do code review using golangci-lint using Woodpecker CI pull request builds","docs":"<p>Woodpecker CI plugin check code with golangci-lint and report results\\nas Pull Request code review using Reviewdog.</p>\\n<h2>Features</h2>\\n<ul>\\n<li>Automatically detect Forge platform and URL</li>\\n<li>Support multiple forges - Gitea, Forgejo, Github, Gitlab</li>\\n</ul>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings Name</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>token</code></td>\\n<td><em>none</em></td>\\n<td>sets Forge API token for</td>\\n</tr>\\n<tr>\\n<td><code>config</code></td>\\n<td><em>none</em></td>\\n<td>sets the custom configuration file path to use</td>\\n</tr>\\n<tr>\\n<td><code>no-config</code></td>\\n<td><code>false</code></td>\\n<td>sets to not use configuation file</td>\\n</tr>\\n<tr>\\n<td><code>timeout</code></td>\\n<td><code>1m</code></td>\\n<td>sets how long to wait for analysis to complete</td>\\n</tr>\\n<tr>\\n<td><code>fast</code></td>\\n<td><code>false</code></td>\\n<td>sets to use only fast linters</td>\\n</tr>\\n<tr>\\n<td><code>tests</code></td>\\n<td><code>true</code></td>\\n<td>sets whether to lint also test files</td>\\n</tr>\\n<tr>\\n<td><code>presets</code></td>\\n<td><em>none</em></td>\\n<td>list of <a href=\\"https://golangci-lint.run/usage/configuration/#linters-configuration\\">presets</a> to use</td>\\n</tr>\\n<tr>\\n<td><code>enable</code></td>\\n<td><em>none</em></td>\\n<td>list of <a href=\\"https://golangci-lint.run/usage/configuration/#linters-configuration\\">linters</a> to use</td>\\n</tr>\\n<tr>\\n<td><code>disable</code></td>\\n<td><em>none</em></td>\\n<td>list of <a href=\\"https://golangci-lint.run/usage/configuration/#linters-configuration\\">linters</a> to disable</td>\\n</tr>\\n</tbody></table>\\n<h2>Advanced settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings Name</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>debug</code></td>\\n<td><code>false</code></td>\\n<td>enable debug mode</td>\\n</tr>\\n<tr>\\n<td><code>tool-name</code></td>\\n<td>golangci</td>\\n<td>custom tool name to report</td>\\n</tr>\\n</tbody></table>\\n<h2>Examples</h2>\\n<pre><code class=\\"language-yaml\\">  review:\\n    image: woodpeckerci/plugin-reviewdog-golangci-lint\\n    settings:\\n      token:\\n        from_secret: botuser_token\\n    when:\\n      event: pull_request\\n</code></pre>\\n","tags":["reviewdog","golangci-lint","code-review"],"author":"Woodpecker Authors","containerImage":"woodpeckerci/plugin-reviewdog-golangci-lint","containerImageUrl":"https://hub.docker.com/r/woodpeckerci/plugin-reviewdog-golangci-lint","verified":true,"iconDataUrl":"data:image/png;base64,"},{"name":"Reviewdog ESLint","slug":"reviewdog-eslint","url":"https://codeberg.org/woodpecker-plugins/reviewdog-eslint","icon":"https://codeberg.org/woodpecker-plugins/reviewdog-eslint/media/branch/main/logo.png","description":"plugin to do code review using ESLint using Woodpecker CI pull request builds","docs":"<p>Woodpecker CI plugin check code with ESLint and report results\\nas Pull Request code review using Reviewdog.</p>\\n<h2>Features</h2>\\n<ul>\\n<li>Automatically detect Forge platform and URL</li>\\n<li>Support multiple forges - Gitea, Forgejo, Github, Gitlab</li>\\n</ul>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings Name</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>token</code></td>\\n<td><em>none</em></td>\\n<td>sets Forge API token for</td>\\n</tr>\\n<tr>\\n<td><code>patterns</code></td>\\n<td><code>.</code></td>\\n<td>list of file patterns to run eslint on</td>\\n</tr>\\n<tr>\\n<td><code>extensions</code></td>\\n<td><em>none</em></td>\\n<td><strong>eslintrc Mode Only</strong>. list of file extensions to lint</td>\\n</tr>\\n<tr>\\n<td><code>config</code></td>\\n<td><em>none</em></td>\\n<td>sets the custom configuration file path to use</td>\\n</tr>\\n<tr>\\n<td><code>no-config</code></td>\\n<td><code>false</code></td>\\n<td><strong>eslintrc Mode Only</strong>. sets to not use configuation file</td>\\n</tr>\\n<tr>\\n<td><code>ignore-path</code></td>\\n<td><code>.eslintignore</code> or <code>.gitignore</code></td>\\n<td><strong>eslintrc Mode Only</strong>. path to pattern ignore file</td>\\n</tr>\\n<tr>\\n<td><code>ignore-patterns</code></td>\\n<td><em>none</em></td>\\n<td>list of file patterns to exclude from linting</td>\\n</tr>\\n</tbody></table>\\n<h2>Advanced settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings Name</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>debug</code></td>\\n<td><code>false</code></td>\\n<td>enable debug mode</td>\\n</tr>\\n<tr>\\n<td><code>tool-name</code></td>\\n<td>-</td>\\n<td>custom tool name to report</td>\\n</tr>\\n</tbody></table>\\n<h2>Examples</h2>\\n<pre><code class=\\"language-yaml\\">  review:\\n    image: woodpeckerci/plugin-reviewdog-eslint\\n    settings:\\n      token:\\n        from_secret: botuser_token\\n    when:\\n      event: pull_request\\n</code></pre>\\n","tags":["reviewdog","eslint","code-review"],"author":"Woodpecker Authors","containerImage":"woodpeckerci/plugin-reviewdog-eslint","containerImageUrl":"https://hub.docker.com/r/woodpeckerci/plugin-reviewdog-eslint","verified":true,"iconDataUrl":"data:image/png;base64,"},{"name":"Ansible","slug":"ansible","url":"https://codeberg.org/woodpecker-plugins/ansible","icon":"https://codeberg.org/woodpecker-plugins/ansible/media/branch/main/ansible.png","description":"Plugin to execute Ansible playbooks","docs":"<h1>Overview</h1>\\n<p>Woodpecker CI plugin to execute Ansible playbooks.\\nThis plugin is a fork of <a href=\\"https://github.com/drone-plugins/drone-ansible\\">drone-plugins/drone-ansible</a> with substantial modifications of the source code.</p>\\n<h2>Features</h2>\\n<ul>\\n<li>Install required dependencies before the start of a playbook</li>\\n<li>Execute Ansible playbooks</li>\\n</ul>\\n<h2>Installing required python module dependencies</h2>\\n<p>Many ansible modules require additional python dependencies to work.\\nBecause ansible is run inside an alpine-based container, these dependencies must be installed dynamically during playbook execution.</p>\\n<p>It is important to use <code>delegate_to: localhost</code> as otherwise the pip module will install the dependency on the remote host, which will not have an effect.</p>\\n<pre><code class=\\"language-yaml\\">- name: Install required pip dependencies\\n  delegate_to: localhost\\n  ansible.builtin.pip:\\n    name: &lt;name&gt;\\n    state: present\\n    extra_args: --break-system-packages\\n</code></pre>\\n<p>Without <code>--break-system-packages</code> alpine will complain aiming for plain pip3 packages being installed system-wide.\\nAlternatively, one can also use the apk/packages module if the required pip module is available as an <code>python3-&lt;name&gt;</code> package</p>\\n<h2>Efficient handling of Ansible dependencies</h2>\\n<p>By default, each step using the plugin will install the required dependencies using <code>ansible-galaxy install -r requirements.yml</code>.\\nOften, one wants to run multiple playbooks in different steps, ideally in parallel.\\nIn this case, a step which installs the requirements for all subsequent steps is useful.</p>\\n<pre><code class=\\"language-yaml\\">steps:\\n  \\"Install galaxy requirements\\":\\n    image: alpine/ansible\\n    commands:\\n      - chmod 750 .\\n      - ansible-galaxy install -r requirements.yml\\n</code></pre>\\n<p>In addition, Ansible dependencies can be cached.\\nThis avoids having to re-download them for each build, saving bandwith and time.\\nIf root access to the Woodpecker instance is given, one can mount a volume to the container and store the dependencies there.</p>\\n<pre><code class=\\"language-yaml\\">steps:\\n  \\"Install galaxy requirements\\":\\n    image: pad92/ansible-alpine\\n    volumes:\\n      - /root/woodpecker-cache/collections:/tmp/collections\\n    commands:\\n      - cp -r /tmp/collections $${CI_WORKSPACE}/\\n      - ansible-galaxy install -r requirements.yml\\n      - cp -r $${CI_WORKSPACE}/collections /tmp/\\n</code></pre>\\n<p>In the above example, the first command copies the cached dependencies to the workspace directory.\\nAfter the installation, the dependencies are copied back to the cache directory.\\nNote that this requires the creation of the cache directory on the host upfront (i.e. <code>/root/woodpecker-cache</code>).\\nThe location of the cache directory can be adjusted to the user\'s needs.</p>\\n<p>Mounting the cache directory directly to <code>$${CI_WORKSPACE}/collections</code> is not feasible due to the following reasons:</p>\\n<ul>\\n<li>The volume mount conflicts with the volume mount providing the workspace directory to each container</li>\\n<li>The mount would need to be added to each step as otherwise the dependencies are missing in these</li>\\n</ul>\\n<h2>Handling complex and multiline secrets</h2>\\n<p>Passing multiline vars via the <code>from_secret</code> notation is problematic as line breaks are not preserved.\\nAn alternative is to use the <code>@</code> notation to pass the secret as a file.\\nTo do this, the secret must be written to a file in a step before the step executing the Ansible plugin.\\nIt must be a YAML or JSON file which contains both the key and value of the variable.</p>\\n<p>The secret file must be parsed as the key in the <code>extra_vars</code> setting with an empty value.\\nThe secret itself must be written as:</p>\\n<pre><code class=\\"language-YAML\\">variable_name: |\\n  &lt;value&gt;\\n</code></pre>\\n<p>In the end, the variable <code>variable_name</code> will be available within the Ansible playbook.</p>\\n<p>If you encounter line-break issues for the secret when creating it in the secret store, the CLI can be used to upload the secret <a href=\\"https://woodpecker-ci.org/docs/usage/secrets#cli\\">via the <code>@</code> notation</a>.</p>\\n<p>A complete example:</p>\\n<pre><code class=\\"language-YAML\\">steps:\\n  \'Write multiline secret\':\\n    image: alpine\\n    environment:\\n      SECRET:\\n        from_secret: multiline_secret\\n    commands:\\n      - echo -e \\"$SECRET\\" &gt; secret.yaml\\n\\n  \'Ansible step\':\\n    image: woodpeckerci/plugin-ansible\\n    settings:\\n      extra_vars:\\n        \'@secret.yaml\': \'\'\\n</code></pre>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings Name</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>become-method</code></td>\\n<td><em>none</em></td>\\n<td>privilege escalation method to use</td>\\n</tr>\\n<tr>\\n<td><code>become-user</code></td>\\n<td><em>none</em></td>\\n<td>run operations as this user</td>\\n</tr>\\n<tr>\\n<td><code>become</code></td>\\n<td><code>false</code></td>\\n<td>run operations with become</td>\\n</tr>\\n<tr>\\n<td><code>check</code></td>\\n<td><code>false</code></td>\\n<td>run in \\"check mode\\"/dry-run, do not apply changes</td>\\n</tr>\\n<tr>\\n<td><code>connection</code></td>\\n<td><em>none</em></td>\\n<td>connection type to use</td>\\n</tr>\\n<tr>\\n<td><code>diff</code></td>\\n<td><code>false</code></td>\\n<td>show the differences (may print secrets!)</td>\\n</tr>\\n<tr>\\n<td><code>extra-vars</code></td>\\n<td><em>none</em></td>\\n<td>set additional variables via <a href=\\"https://docs.ansible.com/ansible/latest/playbook_guide/playbooks_variables.html#key-value-format\\">key=value list or map</a> or load them from <a href=\\"https://docs.ansible.com/ansible/latest/playbook_guide/playbooks_variables.html#vars-from-a-json-or-yaml-file\\">yaml/json files</a> via <code>@</code> prefix</td>\\n</tr>\\n<tr>\\n<td><code>flush-cache</code></td>\\n<td><code>false</code></td>\\n<td>clear the fact cache for every host in inventory</td>\\n</tr>\\n<tr>\\n<td><code>force-handlers</code></td>\\n<td><em>none</em></td>\\n<td>run handlers even if a task fails</td>\\n</tr>\\n<tr>\\n<td><code>forks</code></td>\\n<td><code>5</code></td>\\n<td>number of parallel processes to use</td>\\n</tr>\\n<tr>\\n<td><code>galaxy-force</code></td>\\n<td><code>true</code></td>\\n<td>force overwriting an existing role or collection</td>\\n</tr>\\n<tr>\\n<td><code>galaxy</code></td>\\n<td><em>none</em></td>\\n<td>path to galaxy requirements file</td>\\n</tr>\\n<tr>\\n<td><code>inventory</code></td>\\n<td><em>none</em></td>\\n<td>specify inventory host path</td>\\n</tr>\\n<tr>\\n<td><code>limit</code></td>\\n<td><em>none</em></td>\\n<td>limit selected hosts to an additional pattern</td>\\n</tr>\\n<tr>\\n<td><code>list-hosts</code></td>\\n<td><code>false</code></td>\\n<td>outputs a list of matching hosts</td>\\n</tr>\\n<tr>\\n<td><code>list-tags</code></td>\\n<td><code>false</code></td>\\n<td>list all available tags</td>\\n</tr>\\n<tr>\\n<td><code>list-tasks</code></td>\\n<td><code>false</code></td>\\n<td>list all tasks that would be executed</td>\\n</tr>\\n<tr>\\n<td><code>module-path</code></td>\\n<td><em>none</em></td>\\n<td>prepend paths to module library</td>\\n</tr>\\n<tr>\\n<td><code>playbook</code></td>\\n<td><em>none</em></td>\\n<td>list of playbooks to apply</td>\\n</tr>\\n<tr>\\n<td><code>private-key</code></td>\\n<td><em>none</em></td>\\n<td>SSH private key to connect to host</td>\\n</tr>\\n<tr>\\n<td><code>requirements</code></td>\\n<td><em>none</em></td>\\n<td>path to python requirements file to install</td>\\n</tr>\\n<tr>\\n<td><code>scp-extra-args</code></td>\\n<td><em>none</em></td>\\n<td>specify extra arguments to pass to scp only</td>\\n</tr>\\n<tr>\\n<td><code>sftp-extra-args</code></td>\\n<td><em>none</em></td>\\n<td>specify extra arguments to pass to sftp only</td>\\n</tr>\\n<tr>\\n<td><code>skip-tags</code></td>\\n<td><em>none</em></td>\\n<td>skip tasks and playbooks with a matching tag</td>\\n</tr>\\n<tr>\\n<td><code>ssh-common-args</code></td>\\n<td><em>none</em></td>\\n<td>specify common arguments to pass to sftp/scp/ssh</td>\\n</tr>\\n<tr>\\n<td><code>ssh-extra-args</code></td>\\n<td><em>none</em></td>\\n<td>specify extra arguments to pass to ssh only</td>\\n</tr>\\n<tr>\\n<td><code>start-at-task</code></td>\\n<td><em>none</em></td>\\n<td>start the playbook at the task matching this <strong>name</strong></td>\\n</tr>\\n<tr>\\n<td><code>syntax-check</code></td>\\n<td><code>false</code></td>\\n<td>perform a syntax check on the playbook</td>\\n</tr>\\n<tr>\\n<td><code>tags</code></td>\\n<td><em>none</em></td>\\n<td>only run plays and tasks tagged with these values</td>\\n</tr>\\n<tr>\\n<td><code>timeout</code></td>\\n<td><em>none</em></td>\\n<td>override the connection timeout in seconds</td>\\n</tr>\\n<tr>\\n<td><code>user</code></td>\\n<td><em>none</em></td>\\n<td>connect as this user</td>\\n</tr>\\n<tr>\\n<td><code>vault-id</code></td>\\n<td><em>none</em></td>\\n<td>the vault identity to used</td>\\n</tr>\\n<tr>\\n<td><code>vault-password</code></td>\\n<td><em>none</em></td>\\n<td>vault password</td>\\n</tr>\\n<tr>\\n<td><code>verbose</code></td>\\n<td><code>0</code></td>\\n<td>level of verbosity, 0 up to 4</td>\\n</tr>\\n</tbody></table>\\n<h2>Examples</h2>\\n<pre><code class=\\"language-yaml\\">steps:\\n  \\"[CI Agent] ansible (apply)\\":\\n    image: woodpeckerci/plugin-ansible\\n    settings:\\n      playbook: playbooks/ci/agent.yml\\n      diff: true\\n      inventory: environments/prod/inventory.ini\\n      syntax_check: false\\n      limit: ci_agent_prod\\n      become: true\\n      user: root\\n      private_key:\\n        from_secret: id_ed25519_ci\\n      extra_vars:\\n        woodpecker_agent_secret:\\n          from_secret: woodpecker_agent_secret\\n        woodpecker_agent_secret_baarkerlounger:\\n          from_secret: woodpecker_agent_secret_baarkerlounger\\n</code></pre>\\n","tags":["ansible","playbook","automation"],"author":"Woodpecker Authors","containerImage":"woodpeckerci/plugin-ansible","containerImageUrl":"https://hub.docker.com/r/woodpeckerci/plugin-ansible","verified":true,"iconDataUrl":"data:image/png;base64,"},{"name":"Kaniko","slug":"kaniko","url":"https://github.com/woodpecker-ci/plugin-kaniko","description":"Plugin to build container images without root privileges","docs":"<p>Settings can be defined using the <code>settings</code> option for woodpecker plugins. All available settings and their defaults are listed below.</p>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings Name</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>dry-run</code></td>\\n<td><code>false</code></td>\\n<td>disables docker push</td>\\n</tr>\\n<tr>\\n<td><code>repo</code></td>\\n<td><em>none</em></td>\\n<td>sets repository name for the image (can be a list)</td>\\n</tr>\\n<tr>\\n<td><code>username</code></td>\\n<td><em>none</em></td>\\n<td>sets username to authenticates with</td>\\n</tr>\\n<tr>\\n<td><code>password</code></td>\\n<td><em>none</em></td>\\n<td>sets password / token to authenticates with</td>\\n</tr>\\n<tr>\\n<td><code>registry</code></td>\\n<td><code>https://index.docker.io/v1/</code></td>\\n<td>sets docker registry to authenticate with</td>\\n</tr>\\n<tr>\\n<td><code>dockerfile</code></td>\\n<td><code>Dockerfile</code></td>\\n<td>sets dockerfile to use for the image build</td>\\n</tr>\\n<tr>\\n<td><code>tags</code></td>\\n<td><em>none</em></td>\\n<td>sets repository tags to use for the image</td>\\n</tr>\\n</tbody></table>\\n<h2>Advanced Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings Name</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>context</code></td>\\n<td><code>.</code></td>\\n<td>sets the path of the build context to use</td>\\n</tr>\\n<tr>\\n<td><code>build-args</code></td>\\n<td><em>none</em></td>\\n<td>sets custom build arguments for the build</td>\\n</tr>\\n<tr>\\n<td><code>build-args-from-env</code></td>\\n<td><em>none</em></td>\\n<td>forwards environment variables as custom arguments to the build</td>\\n</tr>\\n<tr>\\n<td><code>auto-tag</code></td>\\n<td><code>false</code></td>\\n<td>if set generate .tags file, support format Major.Minor.Release or start with <code>v</code> docker tags: Major, Major.Minor, Major.Minor.Release and latest</td>\\n</tr>\\n<tr>\\n<td><code>log-level</code></td>\\n<td><code>info</code></td>\\n<td>set different log level</td>\\n</tr>\\n<tr>\\n<td><code>target</code></td>\\n<td><em>none</em></td>\\n<td>indicate which build stage is the target build stage</td>\\n</tr>\\n<tr>\\n<td><code>cache</code></td>\\n<td><code>false</code></td>\\n<td>use a cache repo</td>\\n</tr>\\n<tr>\\n<td><code>cache-repo</code></td>\\n<td><em>none</em></td>\\n<td>specify the cache repo</td>\\n</tr>\\n<tr>\\n<td><code>cache-ttl</code></td>\\n<td><em>none</em></td>\\n<td>set the time to live for the cache</td>\\n</tr>\\n<tr>\\n<td><code>skip-tls-verify</code></td>\\n<td><code>false</code></td>\\n<td>ignore tls issues</td>\\n</tr>\\n<tr>\\n<td><code>mirrors</code></td>\\n<td><em>none</em></td>\\n<td>set docker hub mirrors</td>\\n</tr>\\n<tr>\\n<td><code>json-key</code></td>\\n<td><em>none</em></td>\\n<td>pass a json key to kaniko</td>\\n</tr>\\n<tr>\\n<td><code>insecure</code></td>\\n<td><code>false</code></td>\\n<td>push images to a plain HTTP registry.</td>\\n</tr>\\n<tr>\\n<td><code>insecure-pull</code></td>\\n<td><code>false</code></td>\\n<td>pull images from a plain HTTP registry.</td>\\n</tr>\\n<tr>\\n<td><code>insecure-registry</code></td>\\n<td><em>none</em></td>\\n<td>use plain HTTP requests when accessing the specified registry.</td>\\n</tr>\\n</tbody></table>\\n","tags":["docker","podman","container","build"],"author":"Woodpecker Authors","containerImage":"woodpeckerci/plugin-kaniko","containerImageUrl":"https://hub.docker.com/r/woodpeckerci/plugin-kaniko","verified":true},{"name":"Gradle Wrapper Validation","slug":"gradle-wrapper-validation","url":"https://codeberg.org/beaks/gradle-wrapper-validation","icon":"https://codeberg.org/beaks/gradle-wrapper-validation/raw/branch/main/gradle.svg","description":"plugin to validate the checksums of Gradle Wrapper JAR files","docs":"<p>Woodpecker CI plugin to to validate the checksums of Gradle Wrapper JAR files. This plugin is a port of <a href=\\"https://github.com/gradle/wrapper-validation-action\\">gradle/wrapper-validation-action</a>.</p>\\n<h2>Features</h2>\\n<p>This Woodpecker CI plugin will do one simple task: verify that any and all <code>gradle-wrapper.jar</code> files in the repository match the SHA-256 checksums of any of our official releases.</p>\\n<p>If any are found that do not match the SHA-256 checksums of our official releases, the action will fail.</p>\\n<p>Additionally, the action will find and SHA-256 hash all <a href=\\"https://en.wikipedia.org/wiki/Homoglyph\\">homoglyph</a> variants of files named <code>gradle-wrapper.jar</code>, for example a file named <code>gradl\u0435-wrapper.jar</code> (which uses a Cyrillic <code>\u0435</code> instead of <code>e</code>). The goal is to prevent homoglyph attacks which may be very difficult to spot in a Git diff.</p>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings Name</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>min-wrapper-count</code></td>\\n<td><code>1</code></td>\\n<td>minimum (non-negative) number expected gradle-wrapper.jar files found in the repository. Useful in monorepos</td>\\n</tr>\\n<tr>\\n<td><code>allow-snapshots</code></td>\\n<td><code>false</code></td>\\n<td>allow Gradle snapshot versions during checksum verification</td>\\n</tr>\\n<tr>\\n<td><code>allow-checksums</code></td>\\n<td><code>\\"\\"</code> (none)</td>\\n<td>accept arbitrary user-defined checksums as valid. Comma-separated list of lowercase hex-encoded SHA-256 checksums</td>\\n</tr>\\n</tbody></table>\\n<h2>Examples</h2>\\n<pre><code class=\\"language-yaml\\">validate-gradle-wrapper:\\n  image: codeberg.org/beaks/gradle-wrapper-validation\\n  settings:\\n    min-wrapper-count: 3\\n    allow-snapshots: true\\n    allow-checksums: d73d279b42b037972739203d1d0d15ce3511f5568f51dfbfb41e45b5307535d4\\n  when:\\n    event: pull_request\\n    branch: ${CI_REPO_DEFAULT_BRANCH}\\n</code></pre>\\n","tags":["java","gradle","check","security"],"author":"Nikita Karamov","containerImage":"codeberg.org/beaks/gradle-wrapper-validation","containerImageUrl":"https://codeberg.org/beaks/-/packages/container/gradle-wrapper-validation","verified":false,"iconDataUrl":"data:image/svg+xml;base64,"},{"name":"Sonatype Nexus","slug":"sonatype-nexus","url":"https://github.com/rockdrilla/woodpecker-sonatype-nexus","icon":"https://www.sonatype.com/hubfs/2-2023-Product%20Logos/Repo%20Nav%20Icon%20updated.png","description":"Plugin to publish artifacts to Sonatype Nexus","docs":"<p>Woodpecker CI plugin to publish artifacts to Sonatype Nexus.</p>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Name</th>\\n<th>Required</th>\\n<th>Default value</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>url</code></td>\\n<td><strong>yes</strong></td>\\n<td><em>none</em></td>\\n<td>Sonatype Nexus URL (e.g. <code>https://nexus.domain.com</code>)</td>\\n</tr>\\n<tr>\\n<td><code>auth</code></td>\\n<td><em>no</em> *</td>\\n<td><em>none</em></td>\\n<td>HTTP Basic Authentication (plain-text, in form <code>{username}:{password}</code>)</td>\\n</tr>\\n<tr>\\n<td><code>auth.base64</code></td>\\n<td><em>no</em> *</td>\\n<td><em>none</em></td>\\n<td>HTTP Basic Authentication (base64-encoded)</td>\\n</tr>\\n<tr>\\n<td><code>auth.header</code></td>\\n<td><em>no</em> *</td>\\n<td><em>none</em></td>\\n<td>generic HTTP authentication header (in form <code>{Header}={Value}</code>)</td>\\n</tr>\\n<tr>\\n<td><code>upload</code></td>\\n<td><strong>yes</strong></td>\\n<td><code>[]</code></td>\\n<td>List of upload rules (JSON array, see below)</td>\\n</tr>\\n</tbody></table>\\n<p><strong>Notes:</strong></p>\\n<ul>\\n<li><p>At least one authentication setting <strong>must</strong> be provided.</p>\\n<p>If there are more than one setting were specified then setting is selected in order of priority (from most to least):</p>\\n<ul>\\n<li><code>auth.header</code></li>\\n<li><code>auth.base64</code></li>\\n<li><code>auth</code></li>\\n</ul>\\n</li>\\n<li><p>Setting names above are \\"short\\" variants.</p>\\n<p>Full-qualified setting name looks like \\"<code>nexus.{short_name}</code>\\"\\nand has higher priority if short variant is specified too.</p>\\n</li>\\n<li><p>Dots in setting names are NOT mandatory.</p>\\n<p>The one may replace dots (\\"<code>.</code>\\") with hyphens (\\"<code>-</code>\\") or underscores (\\"<code>_</code>\\").</p>\\n</li>\\n</ul>\\n<h3>Upload settings</h3>\\n<p><code>upload</code> list consists of elements with following properties:</p>\\n<table>\\n<thead>\\n<tr>\\n<th>Name</th>\\n<th>Required</th>\\n<th>Default value</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>repository</code></td>\\n<td><strong>yes</strong></td>\\n<td><em>none</em></td>\\n<td>Repository name (of type \\"hosted\\")</td>\\n</tr>\\n<tr>\\n<td><code>paths</code></td>\\n<td><strong>yes</strong></td>\\n<td><em>none</em></td>\\n<td>List of files to upload (accepts <a href=\\"https://pkg.go.dev/path/filepath#Match\\">globs</a>)</td>\\n</tr>\\n</tbody></table>\\n<p>Additional (repository-specific) properties may be specified right with settings specified above.</p>\\n<h2>Example</h2>\\n<pre><code class=\\"language-yaml\\">steps:\\n- name: publish\\n  image: rockdrilla/woodpecker-sonatype-nexus\\n  settings:\\n    url: https://nexus.domain.com\\n    auth.base64:\\n      from_secret: nexus-auth-b64\\n    upload:\\n      - repository: project-apt\\n        paths:\\n          - dist/all/*.deb\\n          - dist/amd64/*.deb\\n      - repository: project-raw\\n        paths:\\n          - dist/raw/all-in-one.tar.xz\\n        # property from upload specification for \\"raw\\" repository\\n        directory: /build/\\n      - repository: project-r\\n        paths:\\n          - dist/r/*.tar.gz\\n        # property from upload specification for \\"r\\" repository\\n        pathId: /src/contrib/\\n</code></pre>\\n<h2>Notes</h2>\\n<ul>\\n<li><p>Preferred setting for HTTP Basic Authentication is <code>auth.base64</code> as there is minimal chance for breaking value during serialization/deserialization.</p>\\n</li>\\n<li><p>Generic setting <code>auth.header</code> is provided for cases where authentication differs from HTTP Basic Authentication.</p>\\n</li>\\n<li><p>The one may use <a href=\\"https://help.sonatype.com/en/user-tokens.html\\">User Tokens</a> for HTTP Basic Authentication.</p>\\n<p>There is no need for special handling as tokens are conform to scheme:</p>\\n<p><code>{token name code}:{token pass code}</code></p>\\n</li>\\n<li><p>The one may consult with Sonatype Nexus REST API for repository-specific properties for component uploads.</p>\\n<p>Sonatype Nexus REST API is available via:</p>\\n<ul>\\n<li>Web UI  - <code>https://nexus.domain.com/#admin/system/api</code></li>\\n<li>Swagger - <code>https://nexus.domain.com/service/rest/swagger.json</code></li>\\n</ul>\\n<p>Points of interest are:</p>\\n<ul>\\n<li><code>/v1/formats/upload-specs</code></li>\\n<li><code>/v1/components</code> (with <code>POST</code> method)</li>\\n</ul>\\n<p>Also, there is <a href=\\"https://github.com/rockdrilla/woodpecker-sonatype-nexus/blob/main/nexus/upload_spec/fallback.go\\">fallback upload spec</a>:</p>\\n<ul>\\n<li>if component/asset field does not specify <code>Optional: true</code> then this field is <strong>required</strong>.</li>\\n</ul>\\n</li>\\n</ul>\\n<h2>Known limitations</h2>\\n<ul>\\n<li><p>No more than 32 assets may be uploaded at once (if destination repository type supports multiple upload).</p>\\n<p>This is (merely) artificial limit for <strong>single</strong> upload - plugin will upload all listed files but via several calls.</p>\\n<p>If you suppose that Sonatype Nexus is viable to receive more assets at once - feel free to contact me.</p>\\n</li>\\n</ul>\\n","tags":["publish","Sonatype","Nexus"],"author":"Konstantin Demin","containerImage":"rockdrilla/woodpecker-sonatype-nexus","containerImageUrl":"https://hub.docker.com/r/rockdrilla/woodpecker-sonatype-nexus","verified":false,"iconDataUrl":"data:image/png;base64,"},{"name":"Mastodon Post","slug":"mastodon-post","url":"https://codeberg.org/woodpecker-plugins/mastodon-post","icon":"https://joinmastodon.org/logos/logo-purple.svg","description":"Post statuses to Mastodon.","docs":"<h1>Mastodon Post plugin</h1>\\n<p>Woodpecker plugin to post statuses to Mastodon.</p>\\n<h2>Usage</h2>\\n<pre><code class=\\"language-yaml\\">image: woodpeckerci/plugin-mastodon-post\\nsettings:\\n  server_url: https://mastodon.social\\n  access_token:\\n    from_secret: your_access_token\\n  status: We just released {{ CI_COMMIT_TAG }} \uD83D\uDE80\\n</code></pre>\\n<h3>Settings</h3>\\n<table>\\n<thead>\\n<tr>\\n<th>Setting</th>\\n<th>Description</th>\\n<th>Required?</th>\\n<th>Default</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>server_url</code></td>\\n<td>Mastodon server url, including protocol.</td>\\n<td>Yes</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>access_token</code></td>\\n<td>Mastodon access token. (<a href=\\"#get-access-token\\">How to get Token</a>)</td>\\n<td>Yes</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>status</code></td>\\n<td>Status message (Allows <a href=\\"#templating\\">Templating</a>)</td>\\n<td>Yes (if <code>ai_token</code> is not set)</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>sensitive</code></td>\\n<td>Mark post as sensitive (<code>true</code>)</td>\\n<td>No</td>\\n<td><code>false</code></td>\\n</tr>\\n<tr>\\n<td><code>media</code></td>\\n<td><code>,</code>-separated list of paths to attachments</td>\\n<td>No</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>in_reply_to_id</code></td>\\n<td>ID of post to reply to</td>\\n<td>No</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>spoiler_text</code></td>\\n<td>Spoiler text</td>\\n<td>No</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>visibility</code></td>\\n<td>Visibility (<code>private</code>, <code>unlisted</code>, <code>public</code> or <code>direct</code>)</td>\\n<td>No</td>\\n<td><code>null</code></td>\\n</tr>\\n<tr>\\n<td><code>language</code></td>\\n<td>Status language</td>\\n<td>No</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>ai_token</code></td>\\n<td>Provide an AI token (OpenAI) to generate a status message</td>\\n<td>Yes (if <code>status</code> is not set)</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>ai_model</code></td>\\n<td>Select the model used to generate a status message</td>\\n<td>No</td>\\n<td><code>gpt-3.5-turbo</code></td>\\n</tr>\\n<tr>\\n<td><code>ai_prompt</code></td>\\n<td>Prompt used to generate a status message. (Allows <a href=\\"#templating\\">Templating</a>)</td>\\n<td>No</td>\\n<td><a href=\\"https://codeberg.org/woodpecker-plugins/mastodon-post/src/commit/e40ca562e9e84de40ad4f148ec617f45ed583b11/src/index.ts#L37-L42\\">prompt</a></td>\\n</tr>\\n<tr>\\n<td><code>changelog_file</code></td>\\n<td>File to use for the AI to make a changelog from.</td>\\n<td>No</td>\\n<td><code>CHANGELOG.md</code></td>\\n</tr>\\n</tbody></table>\\n<h3>Get Access Token</h3>\\n<p>In order to get an access token, open your Settings and go to the <code>Development</code> section. There create a new application and make sure that <code>write:statuses</code> is checked (Also requires <code>write:media</code> when using the <code>media</code> setting).<br>After creating your application, copy the text next to <code>Your access token</code> and use that as your <code>access_token</code> value.</p>\\n<h3>Templating</h3>\\n<p>You can use <code>{{ CI_COMMIT_TAG }}</code> and other environment variables in the <code>status</code> or <code>ai_prompt</code> settings.\\nThe <code>ai_prompt</code> template can also use <code>{{ CHANGELOG }}</code> to include the changelog of the release.</p>\\n","tags":["post","status","mastodon"],"containerImage":"woodpeckerci/plugin-mastodon-post","containerImageUrl":"https://hub.docker.com/r/woodpeckerci/plugin-mastodon-post","verified":true,"iconDataUrl":"data:image/svg+xml;base64,"},{"name":"Bluesky Post","slug":"bluesky-post","url":"https://codeberg.org/woodpecker-plugins/bluesky-post","icon":"https://codeberg.org/woodpecker-plugins/bluesky-post/raw/branch/main/bluesky.svg","description":"Post statuses to Bluesky.","docs":"<h1>Bluesky Post plugin</h1>\\n<p>Woodpecker plugin to post statuses to Bluesky.</p>\\n<blockquote>\\n<p>\u26A0\uFE0F Media attachments and facets (links, mentions) are not supported yet.</p>\\n</blockquote>\\n<h2>Usage</h2>\\n<pre><code class=\\"language-yaml\\">image: woodpeckerci/plugin-bluesky-post\\nsettings:\\n  identifier: woodpecker-ci.org\\n  app_password:\\n    from_secret: bluesky_app_password\\n  text: We just released {{ CI_COMMIT_TAG }} \uD83D\uDE80\\n</code></pre>\\n<h3>Settings</h3>\\n<table>\\n<thead>\\n<tr>\\n<th>Setting</th>\\n<th>Description</th>\\n<th>Required?</th>\\n<th>Default</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>service_url</code></td>\\n<td>Bluesky service url, including protocol.</td>\\n<td>No</td>\\n<td><a href=\\"https://bsky.social\\">https://bsky.social</a></td>\\n</tr>\\n<tr>\\n<td><code>identifier</code></td>\\n<td>Your Bluesky handle (without @) or did</td>\\n<td>Yes</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>app_password</code></td>\\n<td>Your Bluesky app password</td>\\n<td>(<a href=\\"#get-app-password\\">How to get an app password</a>)</td>\\n<td>Yes</td>\\n</tr>\\n<tr>\\n<td><code>text</code></td>\\n<td>Text to post (Allows <a href=\\"#templating\\">Templating</a>)</td>\\n<td>Yes (if <code>ai_token</code> is not set)</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>media</code></td>\\n<td><code>,</code>-separated list of paths to attachments</td>\\n<td>No</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>in_reply_to_root</code></td>\\n<td>Root ID of post to reply to</td>\\n<td>No</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>in_reply_to_parent</code></td>\\n<td>Parent ID of post to reply to</td>\\n<td>No</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>languages</code></td>\\n<td><code>,</code>-separated list of post languages</td>\\n<td>No</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>tags</code></td>\\n<td><code>,</code>-separated list of post tags</td>\\n<td>No</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>labels</code></td>\\n<td><code>,</code>-separated list of post labels</td>\\n<td>No</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>ai_token</code></td>\\n<td>Provide an AI token (OpenAI) to generate a post text</td>\\n<td>Yes (if <code>text</code> is not set)</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td><code>ai_model</code></td>\\n<td>Select the model used to generate a post text</td>\\n<td>No</td>\\n<td><code>gpt-4o-mini</code></td>\\n</tr>\\n<tr>\\n<td><code>ai_prompt</code></td>\\n<td>Prompt used to generate a post text. (Allows <a href=\\"#templating\\">Templating</a>)</td>\\n<td>No</td>\\n<td><a href=\\"https://codeberg.org/woodpecker-plugins/mastodon-post/src/commit/e40ca562e9e84de40ad4f148ec617f45ed583b11/src/index.ts#L37-L42\\">prompt</a></td>\\n</tr>\\n<tr>\\n<td><code>changelog_file</code></td>\\n<td>File to use for the AI to make a changelog from.</td>\\n<td>No</td>\\n<td><code>CHANGELOG.md</code></td>\\n</tr>\\n</tbody></table>\\n<h3>Get app password</h3>\\n<p>In order to get an app password, go to <a href=\\"https://bsky.app/settings/app-passwords\\">https://bsky.app/settings/app-passwords</a> and create a new app password.</p>\\n<h3>Templating</h3>\\n<p>You can use <code>{{ CI_COMMIT_TAG }}</code> and other environment variables in the <code>status</code> or <code>ai_prompt</code> settings.\\nThe <code>ai_prompt</code> template can also use <code>{{ CHANGELOG }}</code> to include the changelog of the release.</p>\\n","tags":["post","status","bluesky"],"containerImage":"woodpeckerci/plugin-bluesky-post","containerImageUrl":"https://hub.docker.com/r/woodpeckerci/plugin-bluesky-post","verified":true,"iconDataUrl":"data:image/svg+xml;base64,"},{"name":"Discord","slug":"discord","url":"https://github.com/appleboy/drone-discord","icon":"https://raw.githubusercontent.com/appleboy/drone-discord/master/images/discord-mark-blue.svg","description":"Send message to Discord channel using Webhook","docs":"<p>Webhooks are a low-effort way to post messages to channels in Discord. They do not require a bot user or authentication to use.</p>\\n<p>The webhook provided by discord is a single URL which contains the webhook_id and the webhook_token. The URL follows the following pattern.</p>\\n<pre><code class=\\"language-sh\\">https://discord.com/api/webhooks/&lt;webhook_id&gt;/&lt;webhook_token&gt;\\n</code></pre>\\n<p>The discord plugin posts build status messages to discord channel. The below pipeline configuration demonstrates simple usage:</p>\\n<pre><code class=\\"language-yaml\\">- name: discord notification\\n  image: appleboy/drone-discord\\n  settings:\\n    webhook_id: xxxxxxxxxx\\n    webhook_token: xxxxxxxxxx\\n</code></pre>\\n<p>Example configuration with TTS (text-to-speech) message:</p>\\n<pre><code class=\\"language-diff\\">  - name: discord notification\\n    image: appleboy/drone-discord\\n    settings:\\n      webhook_id: xxxxxxxxxx\\n      webhook_token: xxxxxxxxxx\\n+     tts: true\\n      message: \\"Testing from drone image\\"\\n</code></pre>\\n<p>Example configuration with override the default username of the webhook:</p>\\n<pre><code class=\\"language-diff\\">  - name: discord notification\\n    image: appleboy/drone-discord\\n    settings:\\n      webhook_id: xxxxxxxxxx\\n      webhook_token: xxxxxxxxxx\\n+     username: appleboy\\n      message: \\"Testing from drone image\\"\\n</code></pre>\\n<p>Example configuration with override the default avatar of the webhook:</p>\\n<pre><code class=\\"language-diff\\">  - name: discord notification\\n    image: appleboy/drone-discord\\n    settings:\\n      webhook_id: xxxxxxxxxx\\n      webhook_token: xxxxxxxxxx\\n+     avatar_url: http://exampple.com/appleboy.png\\n      message: \\"Testing from drone image\\"\\n</code></pre>\\n<p>Example configuration with a custom message template:</p>\\n<pre><code class=\\"language-diff\\">  - name: discord notification\\n    image: appleboy/drone-discord\\n    settings:\\n      webhook_id: xxxxxxxxxx\\n      webhook_token: xxxxxxxxxx\\n+     message: &gt;\\n+       {{#success build.status}}\\n+         build {{build.number}} succeeded. Good job.\\n+       {{else}}\\n+         build {{build.number}} failed. Fix me please.\\n+       {{/success}}\\n</code></pre>\\n<p>Example configuration using credentials from secrets:</p>\\n<pre><code class=\\"language-diff\\">  - name: discord notification\\n    image: appleboy/drone-discord\\n    settings:\\n      webhook_id:\\n        from_secret: discord_webhook_id\\n      webhook_token:\\n        from_secret: discord_webhook_token\\n      message: \\"Testing from drone image\\"\\n</code></pre>\\n<h2>Secret Reference</h2>\\n<p>discord_webhook_id\\n: discord webhook id</p>\\n<p>discord_webhook_token\\n: discord webhook token</p>\\n<h2>Parameter Reference</h2>\\n<p>webhook_id\\n: webhook id</p>\\n<p>webhook_token\\n: webhook token</p>\\n<p>avatar_url\\n: override the default avatar of the webhook</p>\\n<p>username\\n: override the default username of the webhook</p>\\n<p>tts\\n: true if this is a TTS message</p>\\n<p>message\\n: the message contents (up to 2000 characters)</p>\\n<h2>Template Reference</h2>\\n<p>repo.owner\\n: repository owner</p>\\n<p>repo.name\\n: repository name</p>\\n<p>build.status\\n: build status type enumeration, either <code>success</code> or <code>failure</code></p>\\n<p>build.event\\n: build event type enumeration, one of <code>push</code>, <code>pull_request</code>, <code>tag</code>, <code>deployment</code></p>\\n<p>build.number\\n: build number</p>\\n<p>build.commit\\n: git sha for current commit</p>\\n<p>build.message\\n: git commit messsage for current commit</p>\\n<p>build.branch\\n: git branch for current commit</p>\\n<p>build.tag\\n: git tag for current commit</p>\\n<p>build.ref\\n: git ref for current commit</p>\\n<p>build.author\\n: git author for current commit</p>\\n<p>build.link\\n: link the the build results in drone</p>\\n<p>build.started\\n: unix timestamp for build started</p>\\n<p>build.finished\\n: unix timestamp for build finished</p>\\n<h2>Template Function Reference</h2>\\n<p>uppercasefirst\\n: converts the first letter of a string to uppercase</p>\\n<p>uppercase\\n: converts a string to uppercase</p>\\n<p>lowercase\\n: converts a string to lowercase. Example <code>{{lowercase build.author}}</code></p>\\n<p>datetime\\n: converts a unix timestamp to a date time string. Example <code>{{datetime build.started}}</code></p>\\n<p>success\\n: returns true if the build is successful</p>\\n<p>failure\\n: returns true if the build is failed</p>\\n<p>truncate\\n: returns a truncated string to n characters. Example <code>{{truncate build.sha 8}}</code></p>\\n<p>urlencode\\n: returns a url encoded string</p>\\n<p>since\\n: returns a duration string between now and the given timestamp. Example <code>{{since build.started}}</code></p>\\n","tags":["notifications","chat"],"author":"appleboy","containerImage":"appleboy/drone-discord","containerImageUrl":"https://hub.docker.com/r/appleboy/drone-discord","verified":false,"iconDataUrl":"data:image/svg+xml;base64,"},{"name":"Deployments plugin","slug":"deployments-plugin","url":"https://github.com/woodpecker-ci/plugin-deployments","description":"Update deployments in your forge","docs":"<h1>plugin-deployments</h1>\\n<p>The extend env plugin extends an existing or creates a new <code>.env</code> file with additional variables like semver information.</p>\\n<p>The below pipeline configuration demonstrates simple usage:</p>\\n<pre><code class=\\"language-yml\\">steps:\\n  extend-env:\\n    image: woodpeckerci/plugin-deployments\\n    settings:\\n      url: https://may-review-environment.example.com\\n      # action: create # This option is normally not necessary as its auto-detected by the pipeline event\\n      forge_token:\\n        from_secrets: github_token\\n</code></pre>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>ACTION</code></td>\\n<td><code>create</code> for all pipeline events apart from <code>pull_request_closed</code> =&gt; <code>delete</code></td>\\n<td><code>create</code> or <code>delete</code> a deployment</td>\\n</tr>\\n<tr>\\n<td><code>NAME</code></td>\\n<td>pull-requests: <code>pr-{pr-number}</code>, tag: <code>{tag-name}</code>, push: `{branch}</td>\\n<td>The name of your deployment</td>\\n</tr>\\n<tr>\\n<td><code>URL</code></td>\\n<td><em>none</em></td>\\n<td>The url to the deployed environment</td>\\n</tr>\\n<tr>\\n<td><code>FORGE_TOKEN</code></td>\\n<td><em>none</em></td>\\n<td>A token to access the forges api</td>\\n</tr>\\n</tbody></table>\\n","tags":["env","semver"],"author":"Woodpecker Authors","containerImage":"woodpeckerci/plugin-deployments","containerImageUrl":"https://hub.docker.com/r/woodpeckerci/plugin-deployments","verified":true},{"name":"Twine","slug":"twine","url":"https://gitea.elara.ws/music-kraken/plugin-twine","description":"Publish a built python project to a PyPi repository","docs":"<p>Woodpecker CI plugin that uses the <a href=\\"https://github.com/pypa/twine/\\">Twine</a> utility to publish a built Python project to a PyPi repository.</p>\\n<h2>Settings</h2>\\n<ul>\\n<li><code>username</code>: The username to authenticate to the repository as. (REQUIRED)</li>\\n<li><code>password</code>: The password to authenticate to the repository with. (REQUIRED)</li>\\n<li><code>comment</code>: The comment to include with the distribution file.</li>\\n<li><code>repository_url</code>: The repository URL to upload the package to.</li>\\n</ul>\\n<h2>Example</h2>\\n<pre><code class=\\"language-yaml\\">steps:\\n  publish:\\n    image: gitea.elara.ws/music-kraken/plugin-twine\\n    settings:\\n      repository_url: \\"https://gitea.elara.ws/api/packages/music-kraken/pypi\\"\\n      username:\\n        from_secret: pypi_username\\n      password:\\n        from_secret: pypi_password\\n</code></pre>\\n","tags":["python","pypi","twine"],"author":"Elara6331","containerImage":"gitea.elara.ws/music-kraken/plugin-twine","containerImageUrl":"https://gitea.elara.ws/music-kraken/-/packages/container/plugin-twine/latest","verified":false},{"name":"Gitea Generic Package","slug":"gitea-generic-package","url":"https://codeberg.org/woodpecker-plugins/docker-buildx","icon":"https://raw.githubusercontent.com/go-gitea/gitea/main/assets/logo.svg","description":"Plugin to Publish Artifacts to Gitea Generic Package Registry.","docs":"<h1>Overview</h1>\\n<p>Woodpecker CI plugin to upload any file to the <em>Gitea Generic Package Registry</em>.</p>\\n<p>For details about the features and limits of the <em>Generic Package Registry</em> their <a href=\\"https://docs.gitea.com/usage/packages/generic\\">docs</a>.</p>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings Name</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>user</code></td>\\n<td><em>none</em></td>\\n<td>Gitea user for basic auth</td>\\n</tr>\\n<tr>\\n<td><code>password</code></td>\\n<td><em>none</em></td>\\n<td>Password for basic auth</td>\\n</tr>\\n<tr>\\n<td><code>debug</code></td>\\n<td><em>none</em></td>\\n<td>Enables debug output if it\'s set to <code>true</code>.</td>\\n</tr>\\n<tr>\\n<td><code>owner</code></td>\\n<td><em>none</em></td>\\n<td>Package owner</td>\\n</tr>\\n<tr>\\n<td><code>package_name</code></td>\\n<td><em>none</em></td>\\n<td>The package name</td>\\n</tr>\\n<tr>\\n<td><code>package_version</code></td>\\n<td><em>none</em></td>\\n<td>Package version</td>\\n</tr>\\n<tr>\\n<td><code>file_source</code></td>\\n<td><em>none</em></td>\\n<td>File source path for upload.</td>\\n</tr>\\n<tr>\\n<td><code>file_name</code></td>\\n<td><em>none</em></td>\\n<td>Package file name</td>\\n</tr>\\n<tr>\\n<td><code>update</code></td>\\n<td><code>false</code></td>\\n<td>Allow update existing package files</td>\\n</tr>\\n</tbody></table>\\n<h2>Examples</h2>\\n<pre><code class=\\"language-yaml\\">when:\\n  - event: [pull_request, tag, cron]\\n  - event: push\\n    branch:\\n      - ${CI_REPO_DEFAULT_BRANCH}\\n\\ndepends_on:\\n  - \'ci\'\\n\\nsteps:\\n  next:\\n    image: ocram85/plugin-gitea-package:latest\\n    pull: true\\n    secrets: [gitea_user, gitea_passwd]\\n    settings:\\n      user:\\n        from_secret: gitea_user\\n      password:\\n        from_secret: gitea_passwd\\n      debug: \'true\'\\n      owner: \'plugins\'\\n      package_name: \'dummy_package\'\\n      package_version: \'0.1.0\'\\n      file_source: \'./README.md\'\\n      file_name: \'readme.md\'\\n      update: \'true\'\\n    when:\\n      event: pull_request\\n      branch: ${CI_REPO_DEFAULT_BRANCH}\\n</code></pre>\\n","tags":["Gitea","publish-package","container","build"],"author":"OCram85","containerImage":"ocram85/plugin-gitea-package","containerImageUrl":"https://hub.docker.com/r/ocram85/plugin-gitea-package","verified":false,"iconDataUrl":"data:image/svg+xml;base64,"},{"name":"Is It Up Yet","slug":"is-it-up-yet","url":"https://github.com/dvjn/woodpecker-is-it-up-yet-plugin","description":"Plugin to check for a service to start listening on a specified host and port.","docs":"<p>Woodpecker CI plugin to check for a service to start listening on a specified host and port.</p>\\n<p>It continuously polls the configured host and port using netcat until the service starts.</p>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Name</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td>host</td>\\n<td><em>none</em></td>\\n<td>Host for the service</td>\\n</tr>\\n<tr>\\n<td>port</td>\\n<td><em>none</em></td>\\n<td>Port for the service</td>\\n</tr>\\n</tbody></table>\\n<h2>Example</h2>\\n<p>Using a detached step:</p>\\n<pre><code class=\\"language-yaml\\">steps:\\n  - name: server\\n    detach: true\\n    image: ...\\n\\n  - name: wait_for_server\\n    image: ghcr.io/dvjn/woodpecker-is-it-up-yet-plugin\\n    settings:\\n      host: server\\n      port: 8080\\n</code></pre>\\n<p>Using a service:</p>\\n<pre><code class=\\"language-yaml\\">steps:\\n  - name: wait_for_server\\n    image: ghcr.io/dvjn/woodpecker-is-it-up-yet-plugin\\n    settings:\\n      host: server\\n      port: 8080\\n\\nservice:\\n  - name: server\\n    image: ...\\n</code></pre>\\n","tags":["woodpecker","service"],"author":"dvjn","containerImage":"ghcr.io/dvjn/woodpecker-is-it-up-yet-plugin","containerImageUrl":"https://github.com/dvjn/woodpecker-is-it-up-yet-plugin/pkgs/container/woodpecker-is-it-up-yet-plugin","verified":false},{"name":"Docker Tags","slug":"docker-tags","url":"https://github.com/dvjn/woodpecker-docker-tags-plugin","description":"Plugin to autogenerate tags for building docker images from Git and CI events.","docs":"<p>Woodpecker CI plugin to autogenerate tags for building docker images from Git and CI events.</p>\\n<p>This plugin can be used to autogenerate <code>.tags</code> file for docker build plugins like\\n<a href=\\"https://github.com/woodpecker-ci/plugin-kaniko\\">woodpecker-ci/plugin-kaniko</a>\\nand\\n<a href=\\"https://codeberg.org/woodpecker-plugins/docker-buildx\\">woodpecker-plugins/docker-buildx</a></p>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Name</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td>tags</td>\\n<td><em>none</em></td>\\n<td>Configuration for generating tags</td>\\n</tr>\\n<tr>\\n<td>tags_file</td>\\n<td>.tags</td>\\n<td>File to save generated tags</td>\\n</tr>\\n</tbody></table>\\n<h2>Example</h2>\\n<pre><code class=\\"language-yaml\\">steps:\\n  - name: generate_docker_tags\\n    image: ghcr.io/dvjn/woodpecker-docker-tags-plugin\\n    settings:\\n      tags: |\\n        edge\\n        pr\\n        semver --format {{major}}\\n        semver --format {{major}}.{{minor}}\\n        semver --format {{version}}\\n        cron --format nightly-%Y%m%d\\n        sha\\n</code></pre>\\n<h2><code>tags</code> input</h2>\\n<p>This is the main input for this plugin. This is a multiline string. Each line\\nrepresents a different tag to be applied. Each line is in the form of a cli\\ncommand.</p>\\n<p>All the available commands are:</p>\\n<ul>\\n<li><a href=\\"#branch\\"><code>branch</code></a></li>\\n<li><a href=\\"#cron\\"><code>cron</code></a></li>\\n<li><a href=\\"#edge\\"><code>edge</code></a></li>\\n<li><a href=\\"#pr\\"><code>pr</code></a></li>\\n<li><a href=\\"#raw\\"><code>raw</code></a></li>\\n<li><a href=\\"#semver\\"><code>semver</code></a></li>\\n<li><a href=\\"#sha\\"><code>sha</code></a></li>\\n<li><a href=\\"#tag\\"><code>tag</code></a></li>\\n</ul>\\n<hr>\\n<h3><code>branch</code></h3>\\n<p>Generates tags from branch names for push events.</p>\\n<pre><code class=\\"language-yaml\\">tags: |\\n  # minimal\\n  branch\\n  # with custom prefix\\n  branch -p branch-\\n</code></pre>\\n<p><strong>Options:</strong></p>\\n<table>\\n<thead>\\n<tr>\\n<th>Option</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>-p</code>, <code>--prefix</code></td>\\n<td><em>empty</em></td>\\n<td>Adds a prefix to the branch name.</td>\\n</tr>\\n</tbody></table>\\n<p><strong>Examples:</strong></p>\\n<table>\\n<thead>\\n<tr>\\n<th>Command</th>\\n<th>Branch</th>\\n<th>Output</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>branch</code></td>\\n<td><code>feature/add-logging</code></td>\\n<td><code>feature-add-logging</code></td>\\n</tr>\\n<tr>\\n<td><code>branch -p br-</code></td>\\n<td><code>feature/add-logging</code></td>\\n<td><code>br-feature-add-logging</code></td>\\n</tr>\\n</tbody></table>\\n<hr>\\n<h3><code>cron</code></h3>\\n<p>Generates datetime based tags on cron events.</p>\\n<pre><code class=\\"language-yaml\\">tags: |\\n  # minimal\\n  cron\\n  # with custom format\\n  cron -f %Y-%m-%d\\n</code></pre>\\n<p><strong>Options:</strong></p>\\n<table>\\n<thead>\\n<tr>\\n<th>Option</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>-f</code>, <code>--format</code></td>\\n<td><code>%Y%m%d</code></td>\\n<td>The tag format. This supports GNU/date format.<br>You can find the reference for the format <a href=\\"https://www.gnu.org/software/coreutils/manual/html_node/Date-format-specifiers.html\\">here</a>.</td>\\n</tr>\\n</tbody></table>\\n<p><strong>Examples:</strong></p>\\n<table>\\n<thead>\\n<tr>\\n<th>Command</th>\\n<th>Output</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>cron</code></td>\\n<td><code>20240602</code></td>\\n</tr>\\n<tr>\\n<td><code>cron -f nightly-%Y-%m-%d</code></td>\\n<td><code>nightly-2024-06-02</code></td>\\n</tr>\\n</tbody></table>\\n<hr>\\n<h3><code>edge</code></h3>\\n<p>Generates edge tags for the default branch. The <code>edge</code> tag reflects the last\\ncommit of the active branch on your Git repository.</p>\\n<pre><code class=\\"language-yaml\\">tags: |\\n  # minimal\\n  edge\\n  # with custom tag value of \\"next\\"\\n  edge -v next\\n  # using branch other than the repository default branch\\n  edge -b dev\\n</code></pre>\\n<p><strong>Options:</strong></p>\\n<table>\\n<thead>\\n<tr>\\n<th>Option</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>-v</code>, <code>--value</code></td>\\n<td><code>edge</code></td>\\n<td>Specifies the value for the tag.</td>\\n</tr>\\n<tr>\\n<td><code>-b</code>, <code>--branch</code></td>\\n<td><em>repository default</em></td>\\n<td>Specifies the branch name.</td>\\n</tr>\\n</tbody></table>\\n<p><strong>Examples:</strong></p>\\n<table>\\n<thead>\\n<tr>\\n<th>Command</th>\\n<th>Branch</th>\\n<th>Output</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>edge</code></td>\\n<td><code>main</code></td>\\n<td><code>edge</code></td>\\n</tr>\\n<tr>\\n<td><code>edge -v latest</code></td>\\n<td><code>main</code></td>\\n<td><code>latest</code></td>\\n</tr>\\n<tr>\\n<td><code>edge -b dev -v dev</code></td>\\n<td><code>dev</code></td>\\n<td><code>dev</code></td>\\n</tr>\\n</tbody></table>\\n<hr>\\n<h3><code>pr</code></h3>\\n<p>Generates tag on pull_request event, based on the pull request\'s id.</p>\\n<pre><code class=\\"language-yaml\\">tags: |\\n  # minimal\\n  pr\\n  # using custom prefix for tags\\n  pr -p pull-\\n</code></pre>\\n<p><strong>Options:</strong></p>\\n<table>\\n<thead>\\n<tr>\\n<th>Option</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>-p</code>, <code>--prefix</code></td>\\n<td><code>pr-</code></td>\\n<td>Adds a prefix to the pull request name.</td>\\n</tr>\\n</tbody></table>\\n<p><strong>Examples:</strong></p>\\n<table>\\n<thead>\\n<tr>\\n<th>Command</th>\\n<th>Pull Request ID</th>\\n<th>Output</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>pr</code></td>\\n<td><code>123</code></td>\\n<td><code>pr-123</code></td>\\n</tr>\\n<tr>\\n<td><code>pr -p pull-</code></td>\\n<td><code>123</code></td>\\n<td><code>pull-123</code></td>\\n</tr>\\n</tbody></table>\\n<hr>\\n<h3><code>semver</code></h3>\\n<p>Generates tags based on semver versions parsed from pushed git tags.</p>\\n<pre><code class=\\"language-yaml\\">tags: |\\n  # minimal\\n  smever\\n  # generate major version tag\\n  semver -f {{major}}\\n  # generate major minor version tag\\n  semver -f {{major}}.{{minor}}\\n</code></pre>\\n<p><strong>Options:</strong></p>\\n<table>\\n<thead>\\n<tr>\\n<th>Option</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>-f</code>, <code>--format</code></td>\\n<td><code>{{version}}</code></td>\\n<td>Specifies the format for the tag.</td>\\n</tr>\\n<tr>\\n<td><code>-v</code>, <code>--value</code></td>\\n<td><em>commit tag</em></td>\\n<td>Specifies the value for the tag.</td>\\n</tr>\\n</tbody></table>\\n<p>The <code>format</code> argument supports the following expressions:</p>\\n<ul>\\n<li><code>{{raw}}</code>: the actual tag</li>\\n<li><code>{{version}}</code>: the cleaned up version</li>\\n<li><code>{{major}}</code>: major version identifier</li>\\n<li><code>{{minor}}</code>: minor version identifier</li>\\n<li><code>{{patch}}</code>: patch version identifier</li>\\n</ul>\\n<p><strong>Examples:</strong></p>\\n<table>\\n<thead>\\n<tr>\\n<th>Command</th>\\n<th>Tag</th>\\n<th>Output</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>semver</code></td>\\n<td><code>v1.2.3</code></td>\\n<td><code>1.2.3</code></td>\\n</tr>\\n<tr>\\n<td><code>semver -f {{raw}}</code></td>\\n<td><code>v1.2.3</code></td>\\n<td><code>v1.2.3</code></td>\\n</tr>\\n<tr>\\n<td><code>semver -f {{version}}</code></td>\\n<td><code>v1.2.3</code></td>\\n<td><code>1.2.3</code></td>\\n</tr>\\n<tr>\\n<td><code>semver -f ver-{{major}}</code></td>\\n<td><code>v1.2.3</code></td>\\n<td><code>ver-1</code></td>\\n</tr>\\n<tr>\\n<td><code>semver -f v{{major}}.{{minor}}</code></td>\\n<td><code>v1.2.3</code></td>\\n<td><code>v1.2</code></td>\\n</tr>\\n<tr>\\n<td><code>semver -f {{patch}}</code></td>\\n<td><code>v1.2.3</code></td>\\n<td><code>3</code></td>\\n</tr>\\n<tr>\\n<td><code>semver -f {{version}}</code></td>\\n<td><code>v1.2.3-rc4</code></td>\\n<td><code>1.2.3-rc4</code></td>\\n</tr>\\n<tr>\\n<td><code>semver -f {{major}}.{{minor}}</code></td>\\n<td><code>v1.2.3-rc4</code></td>\\n<td><code>1.2</code></td>\\n</tr>\\n<tr>\\n<td><code>semver -f {{patch}}</code></td>\\n<td><code>v1.2.3-rc4</code></td>\\n<td><code>3</code></td>\\n</tr>\\n</tbody></table>\\n<hr>\\n<h3><code>raw</code></h3>\\n<p>Generates a raw preconfigured tag on any event.</p>\\n<pre><code class=\\"language-yaml\\">tags: |\\n  # minimal\\n  raw -v last-built\\n</code></pre>\\n<table>\\n<thead>\\n<tr>\\n<th>Option</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>-v</code>, <code>--value</code></td>\\n<td><em>empty</em></td>\\n<td>Specifies the value for the tag.</td>\\n</tr>\\n</tbody></table>\\n<p><strong>Examples:</strong></p>\\n<table>\\n<thead>\\n<tr>\\n<th>Command</th>\\n<th>Output</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>raw -v abcd</code></td>\\n<td><code>abcd</code></td>\\n</tr>\\n</tbody></table>\\n<hr>\\n<h3><code>sha</code></h3>\\n<p>Generates tag using the commit SHA.</p>\\n<pre><code class=\\"language-yaml\\">tags: |\\n  # minimal\\n  sha\\n  # generates tag with full sha\\n  sha -l\\n  # use custom prefix for sha tag\\n  sha -p commit-\\n</code></pre>\\n<p><strong>Options:</strong></p>\\n<table>\\n<thead>\\n<tr>\\n<th>Option</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>-l</code>, <code>--long</code></td>\\n<td><code>false</code></td>\\n<td>Use the full 40 character SHA.</td>\\n</tr>\\n<tr>\\n<td><code>-p</code>, <code>--prefix</code></td>\\n<td><code>sha-</code></td>\\n<td>Adds a prefix to the SHA.</td>\\n</tr>\\n</tbody></table>\\n<p><strong>Examples:</strong></p>\\n<table>\\n<thead>\\n<tr>\\n<th>Command</th>\\n<th>Output</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>sha</code></td>\\n<td><code>sha-abcdef12</code></td>\\n</tr>\\n<tr>\\n<td><code>sha -l</code></td>\\n<td><code>sha-abcdef1234567890abcdef1234567890abcdef12</code></td>\\n</tr>\\n<tr>\\n<td><code>sha -p commit-</code></td>\\n<td><code>commit-abcdef12</code></td>\\n</tr>\\n</tbody></table>\\n<hr>\\n<h3><code>tag</code></h3>\\n<p>Generates tag from pushed git tag.</p>\\n<pre><code class=\\"language-yaml\\">tags: |\\n  # minimal\\n  tag\\n</code></pre>\\n<p><strong>Examples:</strong></p>\\n<table>\\n<thead>\\n<tr>\\n<th>Command</th>\\n<th>Tag</th>\\n<th>Output</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>tag</code></td>\\n<td><code>v1.0.0</code></td>\\n<td><code>v1.0.0</code></td>\\n</tr>\\n</tbody></table>\\n<h2>Notes</h2>\\n<h3>Tag Sanitization</h3>\\n<ol>\\n<li>All the values are converted to lowercase.</li>\\n<li>All the values apart from alphabets, numbers, hyphen (-), underscore (_) and\\nperiod (.) are replaces with a hyphen.</li>\\n<li>The length of the tag is truncated to 128 characters.</li>\\n</ol>\\n","tags":["docker"],"author":"dvjn","containerImage":"ghcr.io/dvjn/woodpecker-docker-tags-plugin","containerImageUrl":"https://github.com/dvjn/woodpecker-docker-tags-plugin/pkgs/container/woodpecker-docker-tags-plugin","verified":false},{"name":"Telegram","slug":"telegram","url":"https://github.com/appleboy/drone-telegram","icon":"https://raw.githubusercontent.com/appleboy/drone-telegram/refs/heads/master/images/logo.svg","description":"Plugin for sending Telegram notifications","docs":"<p>The Telegram plugin posts build status messages to your account. The below pipeline configuration demonstrates simple usage:</p>\\n<pre><code class=\\"language-yaml\\">- name: send telegram notification\\n  image: appleboy/drone-telegram\\n  settings:\\n    token: xxxxxxxxxx\\n    to: telegram_user_id\\n</code></pre>\\n<p>Example configuration with photo message:</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n+     photo:\\n+       - tests/1.png\\n+       - tests/2.png\\n</code></pre>\\n<p>Example configuration with document message:</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n+     document:\\n+       - tests/1.pdf\\n+       - tests/2.pdf\\n</code></pre>\\n<p>Example configuration with sticker message:</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n+     sticker:\\n+       - tests/3.png\\n+       - tests/4.png\\n</code></pre>\\n<p>Example configuration with audio message:</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n+     audio:\\n+       - tests/audio1.mp3\\n+       - tests/audio2.mp3\\n</code></pre>\\n<p>Example configuration with voice message:</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n+     voice:\\n+       - tests/voice1.ogg\\n+       - tests/voice2.ogg\\n</code></pre>\\n<p>Example configuration with location message:</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n+     location:\\n+       - 24.9163213,121.1424972\\n+       - 24.9263213,121.1224972\\n</code></pre>\\n<p>Example configuration with venue message:</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n+     venue:\\n+       - 24.9163213,121.1424972,title,address\\n+       - 24.3163213,121.1824972,title,address\\n</code></pre>\\n<p>Example configuration with video message:</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n+     video:\\n+       - tests/video1.mp4\\n+       - tests/video2.mp4\\n</code></pre>\\n<p>Example configuration with message format (<code>Markdown</code> or <code>HTML</code>), default as <code>Markdown</code>:</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n+     format: Markdown\\n</code></pre>\\n<p>Example configuration with a custom message template:</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n+     message: &gt;\\n+       {{#success build.status}}\\n+         build {{build.number}} succeeded. Good job.\\n+       {{else}}\\n+         build {{build.number}} failed. Fix me please.\\n+       {{/success}}\\n</code></pre>\\n<p>Example configuration with a custom message template loaded from file:</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n+     message_file: message_file.tpl\\n</code></pre>\\n<p>Example configuration with a generic message template loaded from file, with additional extra vars:</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n+     message_file: message_file.tpl\\n+     template_vars:\\n+       env: testing\\n+       app: MyApp\\n</code></pre>\\n<p>Where <code>message_file.tpl</code> is:</p>\\n<pre><code class=\\"language-bash\\">Build finished for *{{tpl.app}}* - *{{tpl.env}}*\\n\\n{{#success build.status}}\\n  build {{build.number}} succeeded. Good job.\\n{{else}}\\n  build {{build.number}} failed. Fix me please.\\n{{/success}}\\n</code></pre>\\n<p>Example configuration with a custom message template, with extra vars loaded from file (e.g. from previous build steps):</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n+     template_vars_file: build_report.json\\n+     message: &gt;\\n+       {{#success build.status}}\\n+         build {{build.number}} succeeded, artefact version = {{tpl.artefact_version}}.\\n+       {{else}}\\n+         build {{build.number}} failed. Fix me please.\\n+       {{/success}}\\n</code></pre>\\n<p>Where <code>build_report.json</code> is:</p>\\n<pre><code>{\\n  ...\\n  \\"artefact_version\\": \\"0.2.3452\\"\\n  ...\\n}\\n</code></pre>\\n<p>Example configuration with a custom socks5 URL:</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n      message: send message using custom socks5 URL\\n+     socks5: socks5://67.204.21.1:64312\\n</code></pre>\\n<p>Disables link previews for links in this message</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n      message: send message without a link preview\\n+     disable_web_page_preview: true\\n</code></pre>\\n<p>Disables notifications for this message</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n      message: send message message silently\\n+     disable_notification: true\\n</code></pre>\\n<h2>Parameter Reference</h2>\\n<p>token\\n: telegram token from <a href=\\"https://core.telegram.org/bots/api\\">telegram developer center</a></p>\\n<p>to\\n: telegram user id (can be requested from the @userinfobot inside Telegram)</p>\\n<p>message\\n: overwrite the default message template</p>\\n<p>message_file\\n: overwrite the default message template with the contents of the specified file</p>\\n<p>template_vars\\n: define additional template vars. Example: <code>var1: hello</code> can be used within the template as <code>tpl.var1</code></p>\\n<p>template_vars_file\\n: load additional template vars from json file. Example: given file content <code>{\\"var1\\":\\"hello\\"}</code>, variable can be used within the template as <code>tpl.var1</code></p>\\n<p>photo\\n: local file path</p>\\n<p>document\\n: local file path</p>\\n<p>sticker\\n: local file path</p>\\n<p>audio\\n: local file path</p>\\n<p>voice\\n: local file path</p>\\n<p>location\\n: local file path</p>\\n<p>video\\n: local file path</p>\\n<p>venue\\n: local file path</p>\\n<p>format\\n: <code>markdown</code> or <code>html</code> format</p>\\n<h2>Template Reference</h2>\\n<p>repo.owner\\n: repository owner</p>\\n<p>repo.name\\n: repository name</p>\\n<p>commit.sha\\n: git sha for current commit</p>\\n<p>commit.branch\\n: git branch for current commit</p>\\n<p>commit.link\\n: git commit link in remote</p>\\n<p>commit.author\\n: git author for current commit</p>\\n<p>commit.email\\n: git author email for current commit</p>\\n<p>commit.message\\n: git current commit message</p>\\n<p>build.status\\n: build status type enumeration, either <code>success</code> or <code>failure</code></p>\\n<p>build.event\\n: build event type enumeration, one of <code>push</code>, <code>pull_request</code>, <code>tag</code>, <code>deployment</code></p>\\n<p>build.number\\n: build number</p>\\n<p>build.tag\\n: git tag for current commit</p>\\n<p>build.link\\n: link the the build results in drone</p>\\n<p>build.started\\n: unix timestamp for build started</p>\\n<p>build.finished\\n: unix timestamp for build finished</p>\\n<h2>Template Function Reference</h2>\\n<p>uppercasefirst\\n: converts the first letter of a string to uppercase</p>\\n<p>uppercase\\n: converts a string to uppercase</p>\\n<p>lowercase\\n: converts a string to lowercase. Example <code>{{lowercase build.author}}</code></p>\\n<p>datetime\\n: converts a unix timestamp to a date time string. Example <code>{{datetime build.started}}</code></p>\\n<p>success\\n: returns true if the build is successful</p>\\n<p>failure\\n: returns true if the build is failed</p>\\n<p>truncate\\n: returns a truncated string to n characters. Example <code>{{truncate build.sha 8}}</code></p>\\n<p>urlencode\\n: returns a url encoded string</p>\\n<p>since\\n: returns a duration string between now and the given timestamp. Example <code>{{since build.started}}</code></p>\\n","tags":["notifications","chat"],"author":"appleboy","containerImage":"docker.io/appleboy/drone-telegram","containerImageUrl":"https://hub.docker.com/r/appleboy/drone-telegram","verified":false,"iconDataUrl":"data:image/svg+xml;base64,"},{"name":"EditorConfig Checker","slug":"editorconfig-checker","url":"https://codeberg.org/woodpecker-plugins/editorconfig-checker","description":"A tool to verify that your files follow the editorconfig rules.","docs":"<h1>Overview</h1>\\n<p>This plugin allows you to check if your files respect editorconfig rules within your Woodpecker CI pipeline.</p>\\n<h2>Simple Example</h2>\\n<pre><code class=\\"language-yaml\\">steps:\\n  check-editorconfig:\\n    image: woodpeckerci/plugin-editorconfig-checker\\n</code></pre>\\n<h2>Advanced Example</h2>\\n<pre><code class=\\"language-yaml\\">steps:\\n  check-editorconfig:\\n    image: woodpeckerci/plugin-editorconfig-checker\\n    settings:\\n      verbose: true\\n      only_changed: true\\n      disable_indent_size: true\\n      ignore_default_excludes: true\\n</code></pre>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings Name</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>config</code></td>\\n<td><em>none</em></td>\\n<td>Path to config file</td>\\n</tr>\\n<tr>\\n<td><code>verbose</code></td>\\n<td><code>false</code></td>\\n<td>Enable verbose output</td>\\n</tr>\\n<tr>\\n<td><code>output_file</code></td>\\n<td><em>none</em></td>\\n<td>Captures output and writes into given file</td>\\n</tr>\\n<tr>\\n<td><code>only_changed</code></td>\\n<td><code>false</code></td>\\n<td>Additionally writes output into file</td>\\n</tr>\\n<tr>\\n<td><code>disable_indent_size</code></td>\\n<td><code>false</code></td>\\n<td>Disable checking indent size</td>\\n</tr>\\n<tr>\\n<td><code>disable_indentation</code></td>\\n<td><code>false</code></td>\\n<td>Disable checking indentation</td>\\n</tr>\\n<tr>\\n<td><code>disable_end_of_line</code></td>\\n<td><code>false</code></td>\\n<td>Disable checking end of line</td>\\n</tr>\\n<tr>\\n<td><code>disable_trim_trailing_whitespace</code></td>\\n<td><code>false</code></td>\\n<td>Disable checking trailing whitespace</td>\\n</tr>\\n<tr>\\n<td><code>disable_insert_final_newline</code></td>\\n<td><code>false</code></td>\\n<td>Disable checking final newline</td>\\n</tr>\\n<tr>\\n<td><code>ignore_default_excludes</code></td>\\n<td><code>false</code></td>\\n<td>Ignore default excludes</td>\\n</tr>\\n</tbody></table>\\n<h2>Default Excludes</h2>\\n<p>When <code>ignore_default_excludes</code> is set to <code>false</code> (default), the plugin will ignore the following patterns:</p>\\n<ul>\\n<li>Version control folders (<code>.git/</code>, <code>.hg/</code>, <code>.svn/</code>)</li>\\n<li>Binary files</li>\\n<li>Minified files</li>\\n<li>Node modules (node_modules/)</li>\\n<li>Vendor directories (vendor/)</li>\\n<li>Generated files</li>\\n</ul>\\n<h2>Notes</h2>\\n<ul>\\n<li>The plugin requires a valid <code>.editorconfig</code> file in your repository</li>\\n<li>When <code>only_changed</code> is set to <code>true</code>, the plugin will only check files that were modified in the current commit or pull request using Woodpecker\'s built-in environment variable</li>\\n</ul>\\n","tags":["lint","editorconfig","code-quality"],"author":"Woodpecker Authors","containerImage":"docker.io/woodpeckerci/plugin-editorconfig-checker","containerImageUrl":"https://hub.docker.com/r/woodpeckerci/plugin-editorconfig-checker","verified":true},{"name":"Teams Notify","slug":"teams-notify","url":"https://github.com/GECO-IT/woodpecker-plugin-teams-notify","icon":"https://upload.wikimedia.org/wikipedia/commons/thumb/c/c9/Microsoft_Office_Teams_%282018%E2%80%93present%29.svg/langfr-110px-Microsoft_Office_Teams_%282018%E2%80%93present%29.svg.png","description":"Plugin to send pipeline status notify to Microsot Teams","docs":"<h1>Teams Notify</h1>\\n<p>Plugin for sending Microsoft Teams notifications with pipeline status.</p>\\n<p>For create an Teams Webhook follow <a href=\\"https://learn.microsoft.com/en-us/microsoftteams/platform/webhooks-and-connectors/how-to/add-incoming-webhook\\">this</a></p>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings Name</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>url</code></td>\\n<td><em>none</em></td>\\n<td>Teams Webhook URL</td>\\n</tr>\\n<tr>\\n<td><code>private_forge</code></td>\\n<td><em>false</em></td>\\n<td>Set this to true if your forge is not accessible to the world</td>\\n</tr>\\n<tr>\\n<td><code>debug</code></td>\\n<td><em>false</em></td>\\n<td>Enable Debug mode</td>\\n</tr>\\n</tbody></table>\\n<h2>Pipeline Usage</h2>\\n<pre><code class=\\"language-yaml\\">...\\nsteps:\\n  teams-notify:\\n    image: gecoit84/woodpecker-teams-notify-plugin\\n    settings:\\n      url:\\n        from_secret: teams_webhook\\n    when:\\n      - status: [success, failure]\\n        event: [push, tag]\\n...\\n</code></pre>\\n<h2>Result</h2>\\n<ul>\\n<li>Success Build Notification</li>\\n</ul>\\n<p><img alt=\\"sucess\\" src=\\"./assets/success.png\\"></p>\\n<ul>\\n<li>Failed Build Notification</li>\\n</ul>\\n<p><img alt=\\"failed\\" src=\\"./assets/failed.png\\"></p>\\n","tags":["notifications","chat"],"author":"Geco-iT Teams","containerImage":"gecoit84/woodpecker-teams-notify-plugin","containerImageUrl":"https://hub.docker.com/r/gecoit84/woodpecker-teams-notify-plugin","verified":false,"iconDataUrl":"data:image/png;base64,"},{"name":"Git Basic Changelog","slug":"git-basic-changelog","url":"https://github.com/GECO-IT/woodpecker-plugin-git-basic-changelog","icon":"https://raw.githubusercontent.com/GECO-IT/woodpecker-plugin-git-basic-changelog/main/asset/git.svg","description":"Plugin to generate basic changelog based on git commit message","docs":"<h1>Woodpecker CI - Git Basic Changelog Plugin</h1>\\n<p>Generate a <strong>CHANGELOG.md</strong> file with all commit logs since the last TAG</p>\\n<ul>\\n<li>Advanced generator: <a href=\\"https://pawamoy.github.io/git-changelog\\">https://pawamoy.github.io/git-changelog</a></li>\\n</ul>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings Name</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>debug</code></td>\\n<td><em>false</em></td>\\n<td>Enable <em>DEBUG</em> mode</td>\\n</tr>\\n</tbody></table>\\n<h2>Pipeline Usage</h2>\\n<pre><code class=\\"language-yaml\\">...\\nclone:\\n  git:\\n    image: woodpeckerci/plugin-git\\n    pull: false  # on Windows agent\\n    settings:  # for git-basic-changelog-plugin\\n      depth: 0\\n      tags: true  # if you use event push for this plugin\\n\\nsteps:\\n  generate-basic-changelog:\\n    image: gecoit84/woodpecker-git-basic-changelog-plugin\\n  settings:\\n    debug: true\\n    when:\\n      event: tag\\n...\\n</code></pre>\\n<h2>Generated changelog example</h2>\\n<pre><code class=\\"language-bash\\">$ cat CHANGELOG.md\\n# What Changed\\n\\n- test new woodpecker windows docker run - v0.153\\n- test new woodpecker windows docker run - v0.152\\n- test new woodpecker windows docker run - v0.151\\n...\\n_**Compare**__: [1.2411.4...1.2411.5](https://...)\\n</code></pre>\\n","tags":["git","log","changelog"],"author":"Geco-iT Teams","containerImage":"gecoit84/woodpecker-git-basic-changelog-plugin","containerImageUrl":"https://hub.docker.com/r/gecoit84/woodpecker-git-basic-changelog-plugin","verified":false,"iconDataUrl":"data:image/svg+xml;base64,"},{"name":"Hugo","slug":"hugo","url":"https://github.com/maurerle/woodpecker-hugo","icon":"https://raw.githubusercontent.com/gohugoio/gohugoioTheme/refs/heads/master/static/images/icon-h/hugo-h-1.svg","description":"Use Hugo static site generator to create HTML output","docs":"<p>The Hugo plugin automatically generates static web page files, which can be published afterwards!</p>\\n<p>The example below demonstrates how you can use the plugin to automatically create static web page files using Hugo plugin:</p>\\n<pre><code class=\\"language-yml\\">steps:\\n- name: build\\n  image: ghcr.io/maurerle/woodpecker-hugo\\n  settings:\\n    hugo_version: 0.144\\n</code></pre>\\n<h4>Customize source, output, theme, config, layout OR content directory paths</h4>\\n<p>You can customize the paths for e. g. the theme, layout, content directory and output directory and much more!</p>\\n<pre><code class=\\"language-yml\\">steps:\\n- name: build\\n  image: ghcr.io/maurerle/woodpecker-hugo\\n  settings:\\n    hugo_version: 0.144\\n    url: https://foo.com\\n+   config: path/to/config\\n+   content: path/to/content/\\n+   layout: path/to/layout\\n+   output: path/to/public\\n+   source: path/to/source\\n+   theme: path/themes/THEMENAME/\\n</code></pre>\\n<h4>Set hostname (and path) to the root</h4>\\n<p>You can also define a base URL directly in the pipeline, which is used when generating the files.</p>\\n<pre><code class=\\"language-yml\\">steps:\\n- name: build\\n  image: ghcr.io/maurerle/woodpecker-hugo\\n  settings:\\n    hugo_version: 0.144\\n    url: https://foo.com\\n    config: path/to/config\\n    content: path/to/content/\\n    layout: path/to/layout\\n    output: path/to/public\\n    source: path/to/source\\n    theme: path/themes/THEMENAME/\\n+   url: https://foo.com\\n</code></pre>\\n<h4>Build sites and include expired, drafts or future content</h4>\\n<p>You can set the <code>buildDrafts</code>, <code>buildExpired</code>, <code>buildFuture</code> settings to configure the generated files.</p>\\n<ul>\\n<li><code>buildDrafts</code> - include content marked as draft</li>\\n<li><code>buildExpired</code> - include expired content</li>\\n<li><code>buildFuture</code> - include content with publishdate in the future</li>\\n</ul>\\n<pre><code class=\\"language-yml\\">steps:\\n- name: build\\n  image: ghcr.io/maurerle/woodpecker-hugo\\n  settings:\\n    hugo_version: 0.144\\n    url: https://foo.com\\n    config: path/to/config\\n    content: path/to/content/\\n    layout: path/to/layout\\n    output: path/to/public\\n    source: path/to/source\\n    theme: path/themes/THEMENAME/\\n    url: https://foo.com\\n+   buildDrafts: true\\n+   buildExpired: true\\n+   buildFuture: true\\n</code></pre>\\n<h4><strong>Example</strong>: Generate Hugo static files and publish them to remote directory using scp</h4>\\n<p>Here is a short example of how to define a pipeline that automatically generates the static web page files with Hugo and then copies them to a remote server via scp. This makes publishing websites a breeze!</p>\\n<pre><code class=\\"language-yml\\">steps:\\n- name: build\\n  image: ghcr.io/maurerle/woodpecker-hugo\\n  settings:\\n    hugo_version: 0.144\\n    pull: always\\n    url: https://foo.com\\n\\n- name: deploy\\n  image: appleboy/drone-scp\\n  settings:\\n    host: 192.168.162.1\\n    target: /var/www/site\\n    source: public/*\\n    username:\\n      from_secret: ssh_username\\n    password:\\n      from_secret: ssh_password\\n    port:\\n      from_secret: ssh_port\\n  when:\\n    branch:\\n    - master\\n    event:\\n      exclude:\\n      - pull_request\\n</code></pre>\\n<h1>Parameter Reference</h1>\\n<p>buildDrafts\\n: Include content marked as draft</p>\\n<p>buildExpired\\n: include expired content</p>\\n<p>buildFuture\\n: include content with publishdate in the future</p>\\n<p>config\\n: config file (default is path/config.yaml|json|toml)</p>\\n<p>content\\n: filesystem path to content directory</p>\\n<p>layout\\n: filesystem path to layout directory</p>\\n<p>output\\n: filesystem path to write files to</p>\\n<p>source\\n: filesystem path to read files relative from</p>\\n<p>theme\\n: theme to use (located in /themes/THEMENAME/)</p>\\n<p>url\\n: hostname (and path) to the root</p>\\n<h1>Contributing</h1>\\n<p>You have suggestions for improvements or features you miss? You are welcome to express all your wishes here. Just create a new Issue on Github and it will be taken care of quickly!</p>\\n<p>Github: <a href=\\"https://github.com/maurerle/woodpecker-hugo\\">https://github.com/maurerle/woodpecker-hugo</a></p>\\n","tags":["tool","hugo","generation","static"],"author":"cbrgm, maurerle","containerImage":"ghcr.io/maurerle/woodpecker-hugo","containerImageUrl":"https://github.com/maurerle/woodpecker-hugo/pkgs/container/woodpecker-hugo","verified":false,"iconDataUrl":"data:image/svg+xml;base64,"},{"name":"Home Assistant Notify","slug":"home-assistant-notify","url":"https://github.com/DHandspikerWade/woodpecker-plugin-ha-notify","description":"Plugin to send notifications of pipeline status via Home Assistant","docs":"<h1>Home Assistant Notify</h1>\\n<p>Plugin to send notifications of pipeline status via Home Assistant.</p>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings Name</th>\\n<th>Required</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>host</code></td>\\n<td><strong>Yes</strong></td>\\n<td>Home Assistant hostname and optional port without protocol</td>\\n</tr>\\n<tr>\\n<td><code>token</code></td>\\n<td><strong>Yes</strong></td>\\n<td>A long-lived access token [<a href=\\"https://developers.home-assistant.io/docs/auth_api/#long-lived-access-token\\">Official Documentation</a>]</td>\\n</tr>\\n<tr>\\n<td><code>notify_id</code></td>\\n<td><strong>Yes</strong></td>\\n<td>ID notify service to use. (Ex: <code>mobile_app_my_phone</code>) [<a href=\\"https://www.home-assistant.io/integrations/notify/\\">Official Documentation</a>]</td>\\n</tr>\\n<tr>\\n<td><code>success_message</code></td>\\n<td>No</td>\\n<td>Optional. Message to display on success</td>\\n</tr>\\n<tr>\\n<td><code>failure_message</code></td>\\n<td>No</td>\\n<td>Optional. Message to display on failure</td>\\n</tr>\\n<tr>\\n<td><code>status</code></td>\\n<td>Depends</td>\\n<td>Optional but required for Woodpecker &gt;3.0 due to <a href=\\"https://github.com/woodpecker-ci/woodpecker/issues/4337\\">woodpecker-ci/woodpecker#4337</a>. Workflow status override</td>\\n</tr>\\n</tbody></table>\\n<h2>Usage</h2>\\n<pre><code class=\\"language-yaml\\">steps:\\n  - name: Send Notification\\n    image: ghcr.io/dhandspikerwade/woodpecker-plugin-ha-notify:1\\n    settings:\\n      host:\\n        from_secret: homeassistant_host\\n      token:\\n        from_secret: homeassistant_token\\n      notify_id:\\n        from_secret: homeassistant_notify\\n      status: failure\\n    when:\\n      - event: [ tag ]\\n</code></pre>\\n<h2>Examples</h2>\\n<h3>Successful Notification</h3>\\n<p><img alt=\\"sucess\\" src=\\"./img/success.png\\"></p>\\n<h3>Failed Notification</h3>\\n<p><img alt=\\"failed\\" src=\\"./img/failed.png\\"></p>\\n","tags":["notifications"],"author":"DHandspikerWade","containerImage":"ghcr.io/dhandspikerwade/woodpecker-plugin-ha-notify:1","containerImageUrl":"https://github.com/DHandspikerWade/woodpecker-plugin-ha-notify/pkgs/container/woodpecker-plugin-ha-notify","verified":false},{"name":"Microsoft Teams Notification","slug":"microsoft-teams-notification","url":"https://github.com/mobydeck/ci-teams-notification","icon":"https://raw.githubusercontent.com/mobydeck/ci-teams-notification/refs/heads/main/assets/ms-teams-logo.png","description":"Plugin to send pipeline notifications to Microsoft Teams using Adaptive Cards","docs":"<h1>Teams Notification Plugin</h1>\\n<p>CI plugin to send pipeline notifications to Microsoft Teams using Adaptive Cards.</p>\\n<p>For creating a Teams Webhook, follow <a href=\\"https://learn.microsoft.com/en-us/microsoftteams/platform/webhooks-and-connectors/how-to/add-incoming-webhook\\">this guide</a>.</p>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Setting Name</th>\\n<th>Description</th>\\n<th>Default</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>webhook_url</code></td>\\n<td>Teams Webhook URL (required)</td>\\n<td><em>none</em></td>\\n</tr>\\n<tr>\\n<td><code>facts</code></td>\\n<td>Comma-separated list of facts to display (project,message,version)</td>\\n<td><em>all</em></td>\\n</tr>\\n<tr>\\n<td><code>buttons</code></td>\\n<td>Comma-separated list of buttons (pipeline,commit,release)</td>\\n<td><em>all</em></td>\\n</tr>\\n<tr>\\n<td><code>variables</code></td>\\n<td>Comma-separated list of environment variables to display</td>\\n<td><em>none</em></td>\\n</tr>\\n<tr>\\n<td><code>debug</code></td>\\n<td>Enable debug output of the card JSON</td>\\n<td><em>false</em></td>\\n</tr>\\n</tbody></table>\\n<h2>Basic Usage</h2>\\n<pre><code class=\\"language-yaml\\">steps:\\n  - name: notify-teams\\n    image: mobydeck/ci-teams-notification\\n    settings:\\n      webhook_url: https://outlook.office.com/webhook/...\\n    when:\\n      - status: [success, failure]\\n        event: [manual, push, tag]\\n</code></pre>\\n<h2>Advanced Usage</h2>\\n<pre><code class=\\"language-yaml\\">steps:\\n  - name: notify-teams\\n    image: mobydeck/ci-teams-notification\\n    settings:\\n      webhook_url:\\n        from_secret: teams_webhook_url\\n      facts: project,version\\n      buttons: pipeline,commit\\n      variables: MY_VAR1,MY_VAR2\\n      debug: true\\n    when:\\n      - status: [success, failure]\\n        event: [manual, push, tag]\\n</code></pre>\\n<h2>Features</h2>\\n<ul>\\n<li>Customizable notification card with:<ul>\\n<li>Pipeline status (success/failure)</li>\\n<li>Author information with avatar</li>\\n<li>Commit/build details</li>\\n<li>Configurable fact sections</li>\\n<li>Optional variables table</li>\\n<li>Customizable action buttons</li>\\n</ul>\\n</li>\\n<li>Base64-encoded avatar images</li>\\n</ul>\\n<h2>Notification Examples</h2>\\n<h3>Success Notification</h3>\\n<p><img alt=\\"success\\" src=\\"https://raw.githubusercontent.com/mobydeck/ci-teams-notification/refs/heads/main/assets/ci-pipeline-succeeded.png\\"></p>\\n<h3>Failure Notification</h3>\\n<p><img alt=\\"failure\\" src=\\"https://raw.githubusercontent.com/mobydeck/ci-teams-notification/refs/heads/main/assets/ci-pipeline-failed.png\\"></p>\\n","tags":["notifications","chat"],"author":"mobydeck","containerImage":"mobydeck/ci-teams-notification","containerImageUrl":"https://hub.docker.com/r/mobydeck/ci-teams-notification","verified":false,"iconDataUrl":"data:image/png;base64,"}]')}}]);